r Automatic Stainless Steel</a>\n</div>\n</div>\n','$(\"#hotspot-10\").hotspot({ \"show_on\" : \"mouseover\" });',NULL,NULL,'',0,'2014-12-02 08:15:29','2014-12-16 07:56:29',1),(53,41,'0',0,0,2,NULL,'','','a7fb6f3c2878edccbf8457eb4fe273f7.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 08:15:46','2014-12-16 07:34:52',1),(54,0,'none',13,0,1,NULL,'Product Highlight: Karl Marais','<div class=\"page\">\n<div class=\"section\">\n<div class=\"layoutArea\">\n<div class=\"column\">\n<ol style=\"list-style-type: none\">\n	<li>\n	<p>\n	<span style=\"font-family: Calibri\"><font size=\"3\">Featuring luxurious designa esthetic,dynamic rectangular case anda unique\n	interlocking bracelet with an uninterrupted, jewelry-inspired butterfly clasp, Marais blends\n	signature style with progressive form for a look and feel as classic as it is innovative. The three hand movement dial is completed with mineral crystal face and stainless steel ionic plating all over, it has both great design and quality. Besides that it is also has water resistant up to 10 ATM.</font></span>\n	</p>\n	<p>\n	<span style=\"font-family: Calibri\"><font size=\"3\">It has a hint of masculine through the gunmetal color and black square dial that looks edgy and straight forward. With a little Karl icon on the dial, it remarks the designer\'s name subtly. </font></span><span style=\"font-size: medium; font-family: Calibri\">It embedded the feel of industrial looking as well as a bit military inspired accent. Suits urban woman with rock chic style as well as those who loves to look edgy and fashion forward. Perfect to be paired with leather jacket, or military epaulet detail outfits. Can be worn on different occassions and surely be one of the latest investment this fall.</span>\n	</p>\n	<p>\n	<span style=\"font-family: Calibri\"><font size=\"3\">Karl Marais is one of our product highlight for fall 2014. See more information on clicking the product page below.</font></span>\n	</p>\n	</li>\n</ol>\n</div>\n</div>\n</div>\n</div>\n','5e933dd74c697fe53e3e7ba225bba5ef.jpg','0489e3c8eac928aa2c204cf839e2ffe7.jpg',NULL,NULL,NULL,NULL,'61,62',0,'2014-12-02 08:20:37','2014-12-09 05:37:35',1),(55,0,'none',11,0,1,NULL,'Enjoy Jakarta!','<p>\nYeay Eid Fitri holiday is coming! Some of you may go out for mudik but the rest will stay here in our love-it-but-hate-it city. One thing that we really love during this holiday season is the traffic.\n</p>\n<p>\nThis is the only time we could drive from Pondok Indah to Sudirman in approximately 15 minutes.\n</p>\n<p>\nIf you are happens to just stay here in Jakarta, we think it will be nice to explore the city and have a new culinary experience. We have some list that you might find interested. Moreover, the traffic is pretty kind to us&hellip; so why don&rsquo;t we drive along and enjoy it?\n</p>\n<p>\n<strong>Warung Nagih </strong>is one of the hippest street foods in town. Located in one of the busiest traffic in Jakarta, which is Tendean, Warung Nagih provided various selection of toast with extraordinary topping, such as marshmallow, rainbow cornflakes, and green tea.\n</p>\n<p>\nDresscode: Casual\n</p>\n<p>\nRecently, Pantai Indah Kapuk becomes one of favorite culinary spot, especially for a desserts enjoyer. If you are a newbie to this area, a visit to <strong>Sumoboo</strong> is a must. They have highly recommended dessert named Nutella Bomb (we bet all of you gonna love this one) and also selections of shaved ice with uber cute appearance.\n</p>\n<p>\nExperience fancy dine at <strong>Akira Back. </strong>A trending Japanese dining located at 12<sup>th</sup> floor, MD Place, Setiabudi, Kuningan. You may taste authentic Japanese cuisine with a dash of Korean. Our recommended menus are Tuna Pizza and Black Cod Miso &ndash; the Black Cod Miso has very pretty presentation. Three things that we love from this restaurant are the service, ambience, and very hygiene toilet.\n</p>\n<p>\nDresscode: Modern Hip\n</p>\n','bcb4495362363730cb4c6fc88ad80efa.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 09:02:50','2014-12-07 06:23:40',1),(56,0,'none',15,23,2,NULL,'Featured Profile: Lulut Marganingtyas on Celebrating Idul Fitri','<p>\nFor Idul Fitri featured profile edition, we had a short interview with one of local bloggers and stylist Lulut Marganingtyas. Read on to see a little insight and her thoughts on celebrating the holy month.\n</p>\n<p>\n<em>Q: What do you most look forward during Ramadhan?</em><br />\nA: A hope in becoming a better person and being more patient\n</p>\n<p>\n<em>Q: What is your favourite dishes during sahur and iftar?</em><br />\nA: All dishes made by my mom is the most perfect. For iftar, I love sop buah and gorengan.\n</p>\n<p>\n<em>Q: How do you keep your body fit during Ramadhan? Any tips?</em><br />\nA: Drink plenty of mineral water during sahur and iftar and eat more fruits.\n</p>\n<p>\n<em>Q: What is your family tradition during Ramadhan ?</em><br />\nA: After prayer, we visit our neighbor&#39;s houses for gathering, after that we visit the oldest uncle&#39;s house.\n</p>\n<p>\n<em>Q: How do you spend your time during Idul fitri day?</em><br />\nA: It&rsquo;s a quality time with my family.\n</p>\n<p>\n<em>Q: How do you implement your style for Idul Fitri ? (Please describe your Lebaran outfit)</em><br />\nA: I plan to wear something simpler than the outfit I often use everyday. For this year, I plan wearing a maxi dress.\n</p>\n<p>\n<em>Q: Your favourite picks from Urban Icon to celebrate Idul fitri?</em><br />\nA: Liebeskind handbag. It can load a lot of stuffs and yet still look stylish.\n</p>\n<p>\n<em>Q: Any message to Urban Icon readers who celebrate Idul Fitri ?</em><br />\nA: Happy Eid Mubarak. Let&#39;s forgive each other. And have a great time with your beloved family.\n</p>\n','0344bc0f1dba4712c6911d7063a8e226.jpg',NULL,NULL,NULL,NULL,NULL,'837,838',0,'2014-12-02 09:06:21','2014-12-18 11:18:35',1),(57,0,'none',8,0,2,NULL,'Swag Summer Sweepstakes Winner','<p>\nBerikut adalah peng