r Bag Your \nCanvas\" bukan ? Kompetisi desain shopping bag design ini didasari oleh \nsupport Urban Icon terhadap gerakan go green dan rajah lingkungan serta \nkecintaan kami kepada seni sekaligus mendukung kaum muda untuk berkarya \ndalam bidang desain visual.<img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />\nDalam post kali ini kami akan mengajak anda untuk mengenal lebih jauh \nmengenai desain tas Urban Icon serta tips tips dalam mengikuti lomba \nini!\n</p>\n<p>\nTentunya kalian sudah pernah melihat beberapa desain tas \nramah lingkungan kami baik di toko ataupun melihat orang lain \nmenentengnya. Desain shopping bag Urban Icon dicetak di atas kain laken \nyang ramah lingkungan dan dapat dipakai berulang kali untuk menghindari \nsampah plastik. Desainnya berganti sekitar empat sampai lima kali dalam \nsetahun, yang dibuat oleh graphic designer kami dan juga feature dari \npemenang lomba Our Bag Your Canvas sebelumnya.\n</p>\n<p>\nSummer 2012: Fashionista.<br />\n Mengambil inspirasi wanita modern, fashion conscious, dan menampilkan produk produk Urban Icon.\n</p>\n<p>\nFall 2012: Urban life in vintage setting oleh Ardiansyah.<br />\nKarya ini merupakan kontribusi Ardiansyah dan desainnya kami sukai \nkarena menampilkan sisi vintage dengan warna dan estetika desain yang \nmenarik. Memiliki komposisi yang seimbang dan tulisan logo Urban Icon \nyang eye catching.\n</p>\n<p>\nWinter 2012: Time frame for work and life.<br />\n \nMemiliki design yang edgy serta warns bold dengan kombinasi hiram dan \ntuning yang kontras. Desain kali ini memiliki sedikit segi maskulin \nnamun diimbangi dengan desain elemen alur dan liukan yang menghubungi \nikon jam satu dengan yang lainnya. Simpel namun merepresentasikan suatu \nfilsafah hidup mengenai waktu yang kita miliki dan bagaimana kita \nmenggunakannya.\n</p>\n<p>\n \n</p>\n<p>\n<strong>1st winner Our Bag Your Canvas 2013: Ardiansyah - Get Blink With Vintage</strong><br />\nVintage menjadi salah satu gaya berpenampilan masa kini, namun image \nvintage yang polos, lembut, dan pastel, sudah menjadi cerita lama. \nSekarang, orang bisa mengekspresikan vintage mereka sendiri dengan \ngestur sedang membuat balon dari permen karet, mencoba mengubah image \nvintage yang polos menjadi lebih ekspresif, seru, dan dinamis. Begitu \npula dengan padanan aksesoris \"statement ring\" yang baru kita jumpai \npada masa kini. Ia kami pilih sebagai pemenang pertama karena desain ini\nmemiliki unsur ceria, ekspresif, dan berkarakter juga memliki estetika \ndesain menarik khususnya penggabungan warna.\n</p>\n<p>\n<strong>2nd winner Our Bag Your Canvas 2014: Secure</strong>\n</p>\n<p>\njejak\nkaki harimau sumatera yang gagah menjadi sumber inspirasi desain tas \nini yang mengusung tema melindungi hewan langka. Pohon melambangkan \nkesadaran manusia untuk memerangi global warming. Sementara simbol mata \nmerupakan ikon aktifitas urban. Desain dengan warna dominan duo-tone ini\nmenggabungkan berbagai aspek yang merupakan concern dari Urban Icon \nsehingga ia menjadi pemenang kedua kami.\n</p>\n<p>\n \n</p>\n<p>\nWinter 2013: Sweet.<br />\nDilambangkan oleh permen yang manis dengan gaya pop art, menggambarkan \nkeinginan Urban Icon untuk menghadirkan pengalaman belanja yang manis \ndan menarik bagi pengunjung.\n</p>\n<p>\nFall 2013: Movie theatre.<br />\n \nMenggambarkan highlight kehidupan kota modern dan kesibukannya yang \ndilambangkan melalui salah satu gedung pertunjukkan ala Broadway dengan \nlampu gemerlap dan papan penunjuk. Menghadirkan inspirasi design vintage\ndengan sentuhan modern melalui pemilihan warna dan efek grafik ala \ntahun 80an.\n</p>\n<p>\nSpring 2014: Thank you<br />\n Terinspirasi dari keinginan\nUrban Icon dalam mengucapkan terimakasih atas dukungan dan support dari\ncustomer kami. Desain memiliki ikon kotak pos dan surat yang \nmerepresentasikan komunikasi kami kepada pelanggan. Dari segi seni \nmenggunakan bentuk shape subjek lugas dengan efek cat air dan goresan \nkuas tradisional.\n</p>\n<p>\n \n</p>\n<p>\nSetelah melihat beberapa desain \nshopping bag Urban Icon, kami akan mengingatkan anda kembali kepada tips\ndan aturan dalam mengikuti lomba Our Bag Your Canvas:\n</p>\n<p>\n1. Desain \nharus original, memiliki tema serta cerita di baliknya dan memiliki \nrelevansi dengan bidang fokus utama kami, yaitu: design yang mewakili \nkarateristik Urban Icon. (edgy,modern,casual, vintage)\n</p>\n<p>\n2. Harus dapat diaplikasikan dengan baik dalam template shopping bag kami yang nantinya akan di print diatas bahan woven laken.\n</p>\n<p>\n3.\nDisarankan menyertakan logo atau nama “Urban Icon” di suatu tempat \ndalam desain Anda. Tidak ada persyaratan untuk mematuhi standar normal \nmerek kami\n</p>\n<p>\n4. Tandatangan designer harus muncul di suatu tempat pada design.\n</p>\n<p>\n5. Tidak dianjurkan untuk memasukkan merek (misalnya: Fossil, DKNY, dll) ke dalam design.\n</p>\n<p>\n6. total 2 File yang dikirimkan harus dibawah 8 MB (resolution 300px, CMYK)<br />\n File 1: Design asli A3 landscape. File 2: implementasi design pada template shopping bag.\n</p>\n<p>\n7. <strong>Kriteria penilaian : kesesuaian tema, konsep design, design aesthetic, applicable untuk shopping bag.</strong>\n</p>\n<p>\n \n</p>\n<p>\nSudah\ntahu kan mengenai evolusi shopping bag Urban Icon dan ciri-ciri \ndesainnya? Apabila kamu hendak mengikuti kompetisi ini, jangan sampai \nketinggalan karena kontes akan berakhir pada tanggal 15 Agustus 2014 !\n</p>\n<p>\nMenangkan hadiah menarik berupa:\n</p>\n<p>\n<strong>1. Wacom Intuous<br />\n </strong><strong>2. Galaxy tab<br />\n </strong><strong>3. Tokidoki watch<br />\n </strong><strong>4. Urban Icon shopping vouchers @ 500.000</strong>\n</p>\n<p>\nKirimkan desain kamu ke <a href=\"mailto:urbanicon@time.co.id\">urbanicon@time.co.id</a> dengan subjek Our Bag Your Canvas. <strong>Karya para pemenang 1,2,3 akan dicetak pada </strong>shopping bag <strong>kami dan semua karya yang masuk menjadi hak </strong><strong>milik PT Sentralwatch Perkasa International.</strong>\n</p>\n','1d67cfa904fdd9b3c0e94bf525737fe5.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 09:10:28','2014-12-09 09:07:29',1),(59,0,'none',9,0,4,NULL,'JKT MoveIn – An Inspirational Youth Movement','<p>\nOrganisasi ini memang terhitung masih baru, namun semangat mereka \ndalam menyatukan kreativitas anak muda melalui dunia seni layak diacungi\ndua jempol. Mengangkat tema “<em>Win the future through education, passion, and dreams”, </em>JKT Move In memberi inspirasi <img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />bagi\nsesama anak muda melalui serangkaian acara Inspirational Session yang \ndiadakan sejak bulan April lalu, dengan puncak acara drama musikal \nberjudul Musikal Sekolahan yang sukses digelar pada 16 dan 17 Agustus \nkemarin di Theater Jakarta, Taman Ismail Marzuki.\n</p>\n<address>\nImage: Doc. Urban Icon & JKT MoveIn</address>\n','54614655b2cd7d8fbc12c7da594da227.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 09:12:03','2014-12-09 08:25:43',1),(60,0,'none',8,0,4,NULL,'Our Bag Your Canvas 2nd Edition Winner','<p>\nHari yang ditunggu telah tiba! Sekarang kami akan mengumumkan \npemenang \"Our Bag Your Canvas 2nd Edition\" yang berlangsung sampai \ntanggal 15 Agustus kemarin. Kami mendapat respon yang jauh lebih baik \ndan banyak partisipan dibanding tahun sebelumnya! <img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />Kami\nmengucapkan terimakasih untuk semua partisipan yang telah meluangkan \nkreatifitas mereka untuk mengikuti perlombaan kami. Berikut adalah \npemenang nya, dan pemenang akan dihubungi langsung oleh tim digital \nUrban Icon mengenai pengambilan hadiah. Bagi yang belum menang, mohon \njangan berkecil hati, karena kami akan kembali lagi dengan kompetisi \nyang menarik !\n</p>\n<p>\n<strong>1st winner: Rizki N M</strong><br />\n Tittle : hmmm<br />\n Description : this is a \"hmmm moment\" when you get out from urban icon store and get the stuff that you love.\n</p>\n<p>\nKita\nmenyukai cara Rizki menggambarkan Urban Icon dengan playful manner. His\ndesign aesthetics is simple but eye catching. By using duo tone and \nbrown lining, it gives an overview of Urban Icon as retail stores in a \nfresh angle. Dengan menggunakan duo tone dan lining coklat, ia memberi \noverview mengenai per an Urban Icon sebagai toko retail melalui sudut \npandang baru dan menggambarkan customer urban icon yang senang dengan \npengalaman berbelanja di Urban Icon. Gabungan warna dan teknik design \ndapat juga blend in dengan sesuai di tas Urban Icon.\n</p>\n<p>\n \n</p>\n<p>\n<strong>2nd winner: Candra Ageng</strong><br />\n Title: Urban City is Urban Icon<br />\nCandra dengan sukses menggabungkan kedua konsep tema Urban dan Eco \nFriendly dengan teknik siluet. Designnya memiliki banyak detail namun \ntidal berlebihan dengan menggunakan gradasi warns moss green dan pastel \ngreen. Desain pun dengan apik dapat diimplementasikan ke tas kami.\n</p>\n<p>\n \n</p>\n<p>\n<strong>3rd winner Iki Iko</strong><br />\n Title: Simple Life<br />\nKehidupan modern dan trend minimalis menjadi konsep dari desain ini. \nTypography sleek dan minimalis yang saling berkaitan dan menyatu dengan \nobyek fashion yang biasa dipakai sehari-hari, menjadi pilihan kita untuk\nmenjalani hidup dengan simpel menggunakan produk Brand Icon. Warna yang\ndigunakan fancy namun tetap vintage look sehingga menyesuaikan image \nbrand.\n</p>\n<p>\nSebuah desain yang edgy dan univeersal (dapat digunakan \noleh pria dan wanita) melalui permainan tipografi dan garis yang \nmembentuk kata Urban Icon. Warna kontras antara tipografi dan background\nmembuat design ini terlihat beda dari yang lain pada tas Urban Icon.\n</p>\n<p>\n \n</p>\n<p>\nBerikut pemenang lain yang juga akan mendapat hadiah hiburan dari Urban Icon karena kami juga menyukai desain kalian !\n</p>\n<p>\n<strong>1st runner up : Kelsey Kiantoro</strong><a href=\"http://www.urbanicon.co.id/wp-content/uploads/2014/08/Screen-Shot-2014-08-20-at-10.54.26-pm.png\"><br />\n </a><strong>2nd winner: ARF BX<br />\n 3rd runner up: Stephen Darmadi</strong>\n</p>\n','3ccf643f1bd6acdbcf2a03d3a9dee8d5.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 09:13:35','2014-12-09 11:35:38',1),(61,0,'none',15,0,2,NULL,'Featured Profile: Bethanny Putri on Juggling Between Fashion, Blogging and Study','<p>\nUrban Icon mendapat kesempatan untuk ngobrol dengan Bethanny Putri, \ndari bidang studinya dan awal mula ia memulai blogging. Hari itu \nBethanny membawa tas IIIBeca dari Urban Icon yang merupakan salah satu \nstructured bag favoritnya. <img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />Untuk\ntau lebih lanjut mengenai jenis tas yang ia suka sampai cerita lebih \ndalam mengenai studinya, simak wawancara Urban Icon berikut ini.\n</p>\n<p>\n<em>Q: Apakah bidang yang kamu lakukan untuk studi?</em><br />\nA: Saya mempelajari international relations yang berfokus kepada \nmasalah keamanan internasional dimana relasi militer sesama Negara \nmenjadi focus studi saya.\n</p>\n<p>\n<em>Q: Apakah yang membuatmu memutuskan untuk memilih bidang studi tersebut?</em><br />\nA: Saya membuat keputusan spontan saat mempelajari literature mandarin \nuntuk S1, demikian pula untuk master, saya membuat keputusan dengan cara\nyang sama karena pilihan universitas saya. Namun bidang ini membuat \nsaya terdorong untuk mempelajari apa yang terjadi di kehidupan kita \nsecara lebih dalam.\n</p>\n<p>\n<em>Q: Bagaimana awalnya kamu memulai blogging?</em><br />\nA: Awalnya saya hanya mempost journal personal pada tahun 2009, lalu \nsaya mengunjungi fashion blog seperti Fashion Toast dan Sea Of Shoes \nlalu menjadi tertarik untuk membuat outfit post secara teratur.\n</p>\n<p>\n<em>Q: Bagaimana kamu menyeimbangkan blogging dan studi?</em><br />\nA: Sepertinya tidak ada exact measurement untuk ukuran passion dalam \nblogging dan studi. Saya bisa bilang bahwa blogging merupakan \nsatu-satunya “pelarian “dari realitas.\n</p>\n<p>\n<em>Q: Bagaimana kamu mendeskripsikan style mu?</em><br />\nA: Style saya adalah feminine, minimalist, dengan layering.\n</p>\n<p>\n<em>Q: Apakah kamu pernah mempertimbangkan fashion sebagai full time job?</em><br />\nA: Saya pernah, namun ibu saya tidak setuju dan memberitahu saya untuk focus pada pekerjaan diplomatis.\n</p>\n<p>\n<em>Q: Apakah yang menjadi pertimbanganmu untuk memilih fashion item?</em><br />\nA: Pertama adalah kualitas, yang kedua adalah harga tentunya! Saya \nmemilih untuk menunggu sampai ada sale dan membeli barang di wishlist \nsaya dengan harga diskon.\n</p>\n<p>\n<em>Q: Menurutmu bagaimana perkembangan fashion di Indonesia?</em><br />\nA: Ada naik turun terjadi namun fashion di Indonesia sedang berkembang dan menjadi lebih stabil daripada 4-5 tahun lalu.\n</p>\n<p>\n<em>Q: Adakah challenges yang kamu hadapi saat melakukan blogging dan studi dalam waktu yang bersamaan?</em><br />\nA: Terkadang saya merasa stress saat belaja, lalu makan lebih banyak. \nSetelah itu aku merasa insecure untuk melakukan outfit post hahah\n</p>\n<p>\n<em>Q: Tipe tas seperti apa yang kamu pilih? Minimalis atau yang memiliki banyak detail ?</em><br />\nA: Saya memilih tipe minimalis namun structured. Tas seringkali \nmerepresentasikan karakter seseorang. Saya merupakan seorang yang simple\ndengan pemikiran complicated.\n</p>\n<p>\n<em>Q: Adakah tas yang kamu incar pada saat ini?</em><br />\nA: Olivia harris’ Shredder Ombre Stud Black at urban icon\n</p>\n<p>\n<em>Q: Apakah ada tips fashion yang bisa kamu share?</em><br />\nA: Wear your outfit proudly!\n</p>\n<p>\n<em>Q: Adakah item favorite kamu dari Urban Icon?</em><br />\nA: Fossil’s Decker stainless steel rose gold watch\n</p>\n<p>\n<em>Q: Apakah kamu mempunyai role model?</em><br />\nA: In fashion: Rumi neely and behati prinsloo\n</p>\n<p>\n<em>Q: Apakah kamu mempunya suatu kegiatan/perihal yang kamu dukung?</em><br />\nA: Awareness to ASEAN COMMUNITY 2015. Sebagai suatu isu mengenai \nprogram free trade sesame anggota ASEAN, dan juga bagaimana Indonesia \nmeningkatkan labour skill.\n</p>\n<p>\n<em>Q: Apa pendapat anda mengenai wanita dalam ruang lingkup pekerjaan?</em><br />\nA: Secara ibu saya adalah pekerja full time, ia mengajari saya banyak \nhal mengenai peran wanita. Di zaman sekarang, pekerja wanita dianggap \nlebih bisa meng-handle berbagai pekerjaan laki laki disbanding \nsebelumnya.\n</p>\n<p>\n<em>Q: Adakah pesan kamu untuk pembaca di luar sana ?</em><br />\nA: Be yourself by not copying others.\n</p>\n','fad04ae2fe7ad123e68cdd5c5de492fc.jpg',NULL,NULL,NULL,NULL,NULL,'545,546,540',0,'2014-12-02 09:15:18','2014-12-09 05:45:03',1),(62,0,'none',7,0,2,NULL,'Our Team: A Little Heroic Act from Surabaya','<p>\nDalam memperingati hari kemerdekaan Indonesia, momen momen tersebut \nmemiliki kesan lekat dengan kepahlawanan. Dari tim Urban Icon sendiri, \nkami terinspirasi oleh tim Surabaya yang saling berbagi dengan pihak \nyang membutuhkan. <img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />Kami\nmewawancarai Djanuar (head of team Urban Icon Surabaya Tunjungan Plaza \n4) untuk mendengar lebih lanjut mengenai kegiatan mereka.\n</p>\n<p>\n<em>Q: Pada awalnya apa yang membuat anda terinspirasi untuk melakukan kegiatan charity ini?<br />\n </em>A:\nKegiatan charity yang dilakukan oleh tim Urban Icon Surabaya \nterinspirasi oleh pemikiran kami di bulan Oktober 2009 bahwa dibalik \nkehidupan kita yang secara general “having fun”, di luar sana masih ada \norang yang membutuhkan. Untuk itu saat Pak Matthew melakukan kunjungan \nke Surabaya dan kami menyampaikan ide tersebut. Maka pada bulan November\n2009 kita melakukan wujud nyata kegiatan penggalangan dana.\n</p>\n<p>\n<em>Q: Dapatkah anda menceritakan proses kegiatan amal tersebut?<br />\n </em>A:\nKita bersama sama mencari panti asuhan di sekitar kami. Fitria (Ciputra\nWorld) menemukan panti asuhan Aljabar, di Penjaringan sari, Surabaya \nTimur, yang menampung 32 anak bayi-sma yang kondisinya memprihatinkan \nkarena tidak memiliki kamar dan beberapa di antara mereka sakit dan \ntidak semuanya memperoleh pendidikan.\n</p>\n<p>\nLalu setelah mengetahui semua kebutuhan mereka, kami mulai membelikan kebutuhan mereka dan kemudian melakukan kunjungan.\n</p>\n<p>\n<em>Q: Tim mana saja yang ikut bekerja sama mewujudkan hal ini?</em><br />\nA: Saya selalu mengundang tim Urban Icon Galaxy Mall, Tunjungan Plaza \n4, Ciputra World, dan Grand City untuk kegiatan bulanan. Tim dari \nFossil, Watch Time, Ripcurl, dan Service Centre juga ikut berbagi untuk \nacara tahunan berbagi takjil. Beberapa loyal customer kami juga antusias\nuntuk ikut menyumbang.\n</p>\n<p>\n<em>Q: Seberapa sering dan bagaimana tim menentukan bentuk sumbangan tiap kunjungan?<br />\n </em>A: Setiap bulan kami akan survey dahulu apa yang mereka butuhkan dan membelikan kebutuhan tersebut, sisanya kami serahkan cash.\n</p>\n<p>\n<em>Q: Apa saja kegiatan kalian di panti asuhan tersebut?</em><br />\nA: Selain membawa kebutuhan, kami mengadakan sholat, games dengan \nhadiah, dan mengajar anak anak. Juga acara berbuka puasa bersama saat \nbulan ramadhan.\n</p>\n<p>\n<em>Q: Apakah saat ini kalian tetap memberi donasi ke tempat yang sama atau berbeda?</em><br />\nA: Pada tahun 2014 kami mencoba mencari panti asuhan lain. Lalu kami \nmemutuskan untuk membantu Panti Asuhan Mulia Kalfani dengan anak anak \nterdiri dari bayi 0-7 tahun. Kegiatan ini berlanjut sampai sekarang\n</p>\n<p>\n<em>Q: Apakah momen paling berkesan dari kegiatan charity ini?</em><br />\nA: Ada suatu kebahagiaan tersendiri saat kita berbagi dan memberi apa \nyg orang lain butuhkan. Misalnya hadiah dari kami berupa alat tulis dan \nbuku pasti akan digunakan. Anak anak tersebut mungkin belum pernah \nmerasakan surprise gift atau mencoba mainan seperti yang kita mainkan. \nMerupakan suatu pemandangan yang mengharukan juga untuk melihat wajah \nbahagia mereka tersebut.\n</p>\n<p>\n<em>Q: Bagaimana dengan kegiatan selama bulan ramadhan ?</em><br />\nA: Ada satu hari dimana kita berbagi takjil untuk masyarakat sekitar \nTaman Apsari Tahun lalu kami membagikan 300pack dan tahun ini 500 pack \nmakanan. Selain itu, kami juga membagikan takjil setiap hari selama \nbulan ramadhan di masjid.\n</p>\n<p>\n<em>Q: Selama aktivitas ini, hal apakah yang anda eksplor pada diri anda?</em><br />\nA: Meningkatkan kepedulian dan simpati, bukan hanya pada saya sendiri \nnamun juga tim. Jangan hanya berpkir untuk diri sendiri karena \nsesederhana apapun kita, kita harus saling membantu.\n</p>\n<p>\n<em>Q: Adakah kesulitan yang dihadapi?</em><br />\nA: Rata” dilakukan baik selama ini. Mungkin pada awal kami mengadakan, \nada masyarakat yang berebut sembako dan terjadi sedikit kericuhan. Namun\nsejak tahun lalu kami membagikan kupon dan memperoleh bantuan \nkepolisian untuk mengamankan wilayah.\n</p>\n<p>\n<em>Q: Adakah saran kepada tim lain yang ingin mengikuti jejak tim kalian?</em><br />\n A: Semua bermulai dari niat hati yang baik dan tulus serta planning eksekusi yang baik\n</p>\n<p>\n<em>Q: Bagi anda sendiri, adakah pahlawan atau panutan anda dalam kehidupan sehari hari?</em><br />\n A: Ibu saya sendiri karena beliau adalah orang yang berjiwa sosial tinggi.<a href=\"http://www.urbanicon.co.id/wp-content/uploads/2014/08/CIMG4459.jpg\"><br />\n </a>\n</p>\n','17fe3de7556118cbf239babf1eec76ed.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 09:17:41','2014-12-09 10:34:03',1),(63,0,'multiple_one',12,15,1,NULL,'Outfit Ideas with Karl Lagerfeld','<p style=\"text-align: justify\">\nSeiring dengan promo perfume Karl Lagerfeld yang sedang berlangsung, \nuntuk blog post kali ini kami hendak menginspirasi anda dengan pilihan \noutfit yang cocok dengan jam tangan Karl Lagerfeld kesayangan anda. \nDengan jiwa edgy, akesoris Karl Lagerfeld yang masuk sejak akhir tahun \n2012 di Urban Icon, cocok untuk anda para fashionista yang mengutamakan style dan juga fungsi.\n</p>\n<p style=\"text-align: justify\">\nKarl\nZip Edge White Patent Leather merupakan salah satu best selling series.\nDengan leather putih berhiaskan zipper yang bisa dibuka, jam tangan ini\nmemiliki dial hitam dan diamond triangle hitam. Cocok untuk anda \npenyuka minimalis edgy dengan nuansa monokromatis. Gabungkan dengan \nparfum Karl Lagerfeld Eau de Parfum for women, Erin Tab Multifunction \nBlack Bone dan Duane Street Messenger berstud hitam dari IIIbeca.\n</p>\n<p style=\"text-align: justify\">\nAlternatif\njam tangan wanita lainnya adalah Karl 7 Klassic dengan sepuhan full \nrose gold yang juga memiliki subdial. Lengkapi juga dengan dompet Sydney\nZip Clutch Stripes senada. Padukan dengan dress, tas cerah Fossil \nShopper Watermelon, dan Dot Galaxy S4 case untuk tampilan fresh dan \nyoung.\n</p>\n<p style=\"text-align: justify\">  </p>\n<p style=\"text-align: justify\">\nUntuk anda pria modern, Karl Lagerfeld juga menghadirkan \npilihan jam tangan yang akan menjadi daya tarik tersendiri saat dipakai.\nEnergy Sport Black Round Dial merupakan salah satu jam tangan andalan \nyang bisa dipakai untuk kasual maupun formal. Dilengkapi subdial dengan \nstrap stainless steel, ia menghadirkan kesan sporty elegan dengan warna \nhitam ikon dari Karl sendiri. Lengkapi dengan new arrival kami Mercer \nTop Zip Workbag, Hale Sliding 2 in 1 wallet, dan Trumpet Iphone 5 Case \nserta sneakers high top andalan anda, untuk tampilan full black which \nnever goes wrong.</p>\n<p style=\"text-align: justify\"><br></p>\n<p style=\"text-align: justify\">\nUntuk penampilan lebih kasual, gunakan Karl 7 \nKlassic Black Gold dengan three hand dial dan aksen pyramid di seputar \ntop ring. Padukan dengan Karl Lagerfeld perfume for men, ransel Estate \nCasual Rucksack Stripes dan Addison Traveller Navy senada yang cocok \ndengan denim, chambray, dan brogues.\n</p>\n','5ef5fb20ee14e102bbfab8d2d2759e70.jpg','7a108149b915d100ff37249da3a55137.png','<div id=\"hotspot-15\" class=\"hs-wrap hs-loading\">\n<img src=\"http://urbanicon.co.id/urbanfront/admin/../userfiles/Image/article/5ef5fb20ee14e102bbfab8d2d2759e70.jpg\">\n</div>\n','$(\"#hotspot-15\").hotspot({ \"show_on\" : \"mouseover\" });',NULL,NULL,'',0,'2014-12-02 09:23:57','2014-12-18 11:18:15',1),(64,0,'none',8,0,2,NULL,'Liebeskind Now Available at Pondok Indah Mall I','<p>\nSalah satu brand andalan kami, Liebeskind, memperoleh tanggapan yang \nsemakin meningkat dari hari ke hari. Setelah ekspansi melalui Pop Up \nStore di Plaza Indonesia<img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />,\nsaat ini brand tersebut juga tersedia di Urban Icon Pondok Indah Mall. \nBrand handbags dan leather goods dari Berlin ini juga baru saja \nmeluncurkan koleksi Fall Winter 2014. Jadi tunggu apa lagi, segera \nkunjungi toko Urban Icon untuk menjadi yang pertama memiliki koleksi \nterbarunya!\n</p>\n','fcbf9822f1d23de5ee1d0cba31ab8b96.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 09:25:50','2014-12-09 11:34:49',1),(65,0,'multiple_pagination',11,0,2,NULL,'The Art of Coffee','<p>\nSeiring dengan banyaknya coffee shop yang bermunculan di Jakarta, tim\nUrban Icon menyempatkan untuk mengunjungi beberapa coffee shop yang \nletaknya tidak jauh dari kantor kami. Hal yang menarik perhatian kami \nsetiap kali mengunjungi coffee shop <img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />selain\njenis kopi yang disuguhkan, adalah latte art on our cup. So here&#39;s our \nround up for the coffee shop review with their latte art !\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;<strong>1. Trafique Coffee</strong>\n</p>\n<p>\nCoffee shop yang cukup baru ini letaknya cukup tersembunyi. Terletak di jalan Hang Lekir Raya no 9, ia berada di sisi kiri jalan dan memiliki exterior bata putih berpintu kuning yang eye catching. We think this is one of the coziest coffee place! Dengan gaya semi industrial berhiaskan vintage ornament, coffee shop ini berkapasitas 10 table yang bervariasi seatnya. Dengan espresso machine La Marzocco dan kopi yang mereka roast sendiri in house, Menu mereka cukup beragam dari klasik cappuccino sampai cold drip. Tersedia juga beragam pastry untuk menemani waktu ngopi anda. Kami memesan Lestretto (espresso dengan soda dan lemon), green tea latte, dan favorit kami adalah hazelnut coffee latte yang memiliki medium bodied dan manis yang pas. Latte art yang kami dapat adalah klasik leaves andalan para barista.\n</p>\n<p>\n<strong>2. Le Cafe Gourmand</strong><br />\nCabang dari Le Cafe Gourmand di Surabaya, coffee shop yang tarletak di jalan Gunawarman Jakarta ini merupakah one of the hippest hangout place of the moment. Coffee shop ini memiliki interior yang cukup menarik dengan dekorasi modern dan full painting di salah satu dindingnya. Sore itu cukup ramai, kami memesan coffee latte, nutella crepes, macaroon, dan juga ice cream andalan mereka (we keep craving for more too). Coffee latte kami memiliki latte art piggy diatasnya, which we think is one of the cutest latte art !\n</p>\n<p>\n<strong>3. Monolog Coffee</strong><br />\nSudah menjadi favorit kami sejak mereka buka di Plaza Senayan, kali ini kami mengunjungi branch mereka di Pondok Indah Mall 3. Dengan tempat yang jauh lebih luas dilengkapi seating indoor dan outdoor, Monolog tetap selalu ramai saat weekend. Mereka juga menjual berbagai perlengkapan untuk brewing coffee sendiri, mulai dari hand grinder sampai V60 set. Anda dapat menikmati hot atau iced coffee dengan menu brunch yang tidak kalah menarik. Menu yang kami pesan adalah iced green tea, coffee latte, cappuccino dan macaroon- rasa favorit kami adalah earl grey dan strawberry yang tidak terlalu manis. Latte art Monolog simple dan to the point dengan ukiran tulip untuk coffe latte dan hati untuk cappuccino.\n</p>\n<p>\nBagaimana dengan anda? tweet coffee shop favorite anda ke twitter @urbaniconstore atau tag instagram kami @urbaniconstore to join the conversation!\n</p>\n','57eae1e39d0da7151f5ffe365ba81d5f.JPG',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 09:27:11','2014-12-09 11:49:05',1),(66,0,'none',6,0,4,NULL,'Top Three Accessories Trend Fall Winter 2014','<p>\nSeperti yang kita ketahui, menjelang akhir tahun, dalam dunia fashion\nada perubahan trend dalam menyambut musim fall winter. Dari sekian \nbanyak trend fall winter 2014 yang diulas di berbagai media fashion, tim\nUrban Icon memiliki beberapa pilihan <img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />bagi anda para fashion conscious. Berikut top three accessories trend untuk fall winter 2014 yang menjadi pilihan tim kami.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n1. 60s mood<br />\nKembali ke gaya tahun 60an yang youthful dan playful, trend 2014 \nmengusung aksesoris yang berbahan pvc, rubber dan dress mini ala twiggy.\nSocial Media executive kami, Aruminati memilih jam tangan Armani \nberstrap polyurethane AR 1054 berwarna putih yang kasual dan playful. \nPilihan lainnya dapat jatuh ke new arrival Karl Lagerfeld Perspektive \nWhite Rubber Pyramid. Untuk tas, kali ini Fossil Sydney merupakan top \npicks Tania. Graphic Designer Urban Icon, yang hadir dengan bahan PVC. \nSeri ZB5780-200 merupakan salah satu limited edition yang termasuk dalam\ntrend 60s mod yang memang menggunakan material pvc. Lengkapi gaya \ndengan Sydney Zip Clutch dengan nuansa colorblock monokromatis.\n</p>\n<p>\n&quot;Tas\nfossil ini memiliki bahan pvc, berbeda dari item season lain yang \nbiasanya terbuat dari leather. Warna coklatnya memberi kesan see through\nitem yang kita bawa, cocok untuk suasana kasual.&quot; - Tania (Graphic \nDesigner Urban Icon)\n</p>\n<p>\n&quot;Jam tangan ini berbeda dari seri Emporio \nArmani lainnya karena polyuretahne strap dan dial ala clear bubble yang \nplayful dan sporty&quot; - Aruminati (Social Media Marketing Urban Icon )\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n2. Military rules\n</p>\n<p>\nMilitary\ntrend is back untuk musim fall winter tahun ini. Tough, edgy, dengan \nwarn dominion hijau olive, hitam, dan coklat, trend ini menjadi favorit \npara fashionista. Investasikan sebuah jam tangan bernuansa militer yang \nbisa dipakai untuk berbagai suasana. Emporio Armani AR1782 menjadi \npilihan Basuki dari divisi Marketing karena lightweight dan fitur \ninterchangeable strap (leather dan canvas). Selain itu, Retro Traveler \nChronograph Brown Leather dari Fossil juga dapat menjadi option karena \nstrap bergaya militernya yang maskulin. Untuk tas, Janet Gunara, product\nmerchandiser kami memilih brand Tribeca yang cukup berani dalam \nmengusung trend ini, dapat terlihat pada Murray Street Crossbody \nberwarna hijau militer dan Reade Street Tote dengan subtle owl prints \nberwarna hijau militer dan hitam.\n</p>\n<p>\n&quot;Tas Tribeca biasanya berwarna \nplain, namun Reade Street Tote ini mempunyai owl prints dan berbahan \nsafiano, tipe leather baru yang diusung oleh brand asal New York ini.&quot; -\nJanet Gunara - (Product Merchandiser Urban Icon)\n</p>\n<p>\n&quot;Jam Tangan \nArmani ini sangat lightweight, baik dari segi dial ataupun leather strap\nnya yang smooth, karena kebanyakan jam tangan pria terkesan sangat \nbulky. Jam ini sleek dan juga memiliki fitur strap yang bisa diganti.&quot; -\nBasuki Rachmad (Marketing Support Urban Icon)\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n3. Jewel tone\n</p>\n<p>\nUntuk\ntrend warna, fall winter biasa hadir dalam warna gelap, dan untuk tahun\nini ada banyak nuansa warna gemstones yang terlihat. Warna emerald, \nsapphire, dan deep ruby red menguasai catwalk fashion mancanegara. Salah\nsatu brand favorit dari Urban Icon, Liebeskind juga hadir dalam nuansa \nwarna burgundy atau deep ruby red. Salah satu item andalan pilihan \nDigital Business Executive Urban Icon, Fhenny, adalah Alex wallet. \nWarnanya yang trendy didapat dari teknik double dyed leather dan dompet \nini juga memiliki banyak kompartmen. pilihan lainnya adalah dompet \nFossil Sydney Tab Clutch pilihan Rika, Retail Operational Assistant \nUrban Icon, dengan croc effect leather yang elegan. Untuk jam tangan, \nnuansa ruby dan inspirasi sapphire tone bisa dilihat pada Marc by Marc \nJacobs Amy Red Cabernet dengan strap silver stainless steel dan Michael \nKors Dylan Chronograph yang menjadi best seller kami.\n</p>\n<p>\n&quot;Liebeskind \nselalu hadir dengan high quality leather goods, dan Alex wallet ini \nmemiliki sistem pewarnaan double dyed yang memberi warna tersendiri, ia \njuga termasuk salah satu warna paling trendy untuk fall winter 2014 \nyaitu burgundy.&quot; - Fhenny (Digital Executive Urban Icon)\n</p>\n<p>\n&quot;Pada \ndasarnya saya memang penggemar animal prints dan dompet seasonal Fossil \nyang memiliki embossed stamped crocodile prints ini terlihat elegan dan \nwarnanya stand out sebagai aksesoris sehari hari.&quot; - Rika N (Retail \nOperation Assistant Urban Icon)\n</p>\n<p>\nDari tiga trend diatas, yang mana \nyang menjadi pilihan anda? Join the conversation by mentioning \n@urbaniconstore via twitter atau instagram.\n</p>\n','cddea31e2344b6cb6c820ff3add6116e.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 09:28:34','2014-12-01 11:28:34',1),(67,0,'none',7,0,4,NULL,'IIIBeca Fall Winter 2014 Highlight','<p>\nIIIBeca merupakan salah satu line aksesoris dan tas milik Joy Gryson,\nfigur yang telah lama dikenal dalam dunia fashion dan aksesoris di New \nYork. Nama Tribeca sendiri diambil dari salah satu daerah di New York \ndimana ia bekerja. <img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />Selebriti layaknya Michelle Williams dan Jessica Biel sangat menyukai seri North Moore Satchel dari brand ini.\n</p>\n<p>\nUntuk\nFall Winter 2014, IIIBeca hadir dengan jenis bahan baru yaitu real \nsaffiano leather yang elegan dalam berbagai shade warna khas musim \ngugur. Temukan warna trendi Military, pilihan yang lebih netral Bark, \natau warna pop up Berry, dan Ochre. Bila anda penggemar warna klasik \ntemukan Black Saffiano leather dalam salah satu pilihan yang tersedia.\n</p>\n<p>\nSelain\nitu, musim ini IIIBeca hadir pertama kalinya dalam corak print owl \ndengan kombinasi warna hijau militer-black atau merah marun-ochre. \nMerupakan salah satu pilihan yang unik namun tidak over the top.\n</p>\n','90f16a7b7dfefe78955e5efa28337583.png','a42d4a6a13f768556b3c0b2363288027.png',NULL,NULL,NULL,NULL,'544,540,555,543',0,'2014-12-02 09:30:23','2014-12-09 12:15:22',1),(68,0,'multiple_pagination',14,22,2,NULL,'The It Urban Timepiece','We curated this season hottest timepiece especially for urban guy! Make sure you choose ones that suit your personal style.','5d6b294770cf6bd86ab13f904e459792.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 12:15:42','2014-12-11 13:50:56',1),(69,68,'0',0,0,2,NULL,'','','4802482508231b8e5c281e95ba33172e.jpg',NULL,'<div id=\"hotspot-19\" class=\"hs-wrap hs-loading\">\n<img src=\"http://www.urbanicon.co.id/urbanfront/admin/../userfiles/Image/article/4802482508231b8e5c281e95ba33172e.jpg\">\n<div class=\"hs-spot-object\" data-type=\"spot\" data-x=\"357\" data-y=\"380\" data-width=\"30\" data-height=\"30\" data-popup-position=\"left\" data-visible=\"visible\" data-tooltip-width=\"200\" data-tooltip-auto-width=\"true\">\n<a href=”http://www.urbanicon.co.id/urbanfront/product_detail/index/285/Nate-Chronograph-Black-Leather” target=”_blank”>FOSSIL Nate Chronograph Black Leather</a>\n</div>\n</div>\n','$(\"#hotspot-19\").hotspot({ \"show_on\" : \"mouseover\" });',NULL,NULL,'',0,'2014-12-02 12:18:35','2014-12-16 09:52:59',0),(70,68,'0',0,0,2,NULL,'','','274b39e23ca1b95a20b4047ea94bde69.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 12:19:07','2014-12-11 14:37:12',1),(71,68,'0',0,0,2,NULL,'','','708154f150c3f90dc38f2f36482cb8d8.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 12:24:59','2014-12-11 03:12:38',1),(72,68,'0',0,0,2,NULL,'','','8cb5d4948fbb021091831191e7e22db5.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 12:27:16','2014-12-11 03:22:23',1),(73,68,'0',0,0,2,NULL,'','','706951f7a45c974b7ec8cad01c17f509.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 12:33:56','2014-12-01 14:33:56',1),(74,0,'multiple_pagination',12,15,5,NULL,'Holiday Gift Idea','Don&#39;t waste your time thinking the possibly right gift. We openly share Fall latest accessories that will become the thoughtful gift\n','3e36fbb7d1d8a6a4cebf16918e516e2a.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 12:53:34','2014-12-18 11:14:30',0),(75,74,'0',0,0,2,NULL,'','','08ab6c28d1370d0d24a39c6bc385caff.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 12:54:37','2014-12-01 14:54:37',1),(76,0,'none',9,0,2,NULL,'Tips Ilustrasi Dari Pemenang Our Bag Your Canvas','<p>\nDesign Kompetisi \"Our Bag Your Canvas\" 2nd edition kami mendapat \nbanyak respon, lebih daripada tahun sebelumnya. Dari banyak design yang \nmasuk, tim kami memilih 6 pemenang berdasarkan kriteria yang telah \ndisepakati. <img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />Saat\nini Urban Icon memiliki kesempatan untuk berbincang bincang dengan \nkedua pemenang kami, Candra Ageng dan Andhika Pradana untuk mengetahui \nlebih lanjut mengenai seni ilustrasi dan tips mereka bagi anda yang \nhendak mengembangkan hobi tersebut.\n</p>\n<p>\nUI= Urban Icon. C=Candra Ageng. A=Andhika Pradana\n</p>\n<p>\nUI: bagaimana awalnya anda terjun ke dalam dunia ilustrasi?<br />\n C: Awalnya dari kecil saya suka menggambar dan hal-hal yang berbau seni. Jadi, perlahan-lahan belajar <em>editing</em> foto dan membuat desain grafis lewat komputer.<br />\n A: Sejak kecil saya menyukai seni dan pernah mengenyam pendidikan kuliah desain di surabaya\n</p>\n<p>\nUI: Apakah yang anda kerjakan sehari-hari ? apakah anda ada bergabung  dengan komunitas desain/art related ?<br />\n C: Saya Bekerja. Tidak, hanya sering belajar dari teman.<br />\nA: Saya pekerja swasta. untuk komunitas khusus tidak ada, hanya ikut \nberpartisipasi mengikuti kegiatan berbagai komunitas seni kolektif\n</p>\n<p>\nUI: Bagaimana anda medeskripsikan tipe/style ilustrasi anda?<br />\n C: Saya lebih suka desain yang simple, dan tidak terlalu banyak warna.<br />\n A: Saya menyukai Pop art\n</p>\n<p>\nUI: Dari mana anda biasa mencari inspirasi untuk ilustrasi desain anda ?<br />\n C: Dari internet dan media sosial, dan melihat lingkungan sekitar.<br />\n A: Kebanyakan dari internet\n</p>\n<p>\nUI: Ada illustrator atau designer yang anda suka yang bisa anda share ke pembaca Urban Icon sebagai referensi ?<br />\n C: Tidak ada yang spesifik. Karena dunia desain relatif dan seiring berjalannya waktu, banyak jenis <em>style</em> desain-desain baru yang muncul.<br />\n A: Roy lichtenstein, Alex Trochut, Banksy\n</p>\n<p>\nUI: Tools/alat/software apakah yang anda gunakan ?<br />\n C: Adobe Photoshop, Adobe Illustrator, Corel Draw<br />\n A: Software vector & bitmap\n</p>\n<p>\nUI :Saat mendesain untuk Urban Icon bagaimana prosesnya? Dari manakah anda mendapat inspirasi ?<br />\nC: Saya melihat produk yang dipasarkan dan target marketnya. Setelah \nitu, saya pikirkan tema yang sesuai dan pas dicetak di bag tersebut. \nInspirasi saya dapatkan dari hasil-hasil fotografi yang ada di media \nsosial. Lalu, saya muncul ide untuk membuat desain <em>silhoutte.<br />\n </em>A: Saya memulai sketch manual tipografi dan melakukan finishing di software design.\n</p>\n<p>\nUI: Apa saran anda untuk orang yang ingin memulai ilustrasi?<br />\nC: Banyak melihat hasil karya seni/desain yang ada di sekitar kita. \nMaka, ide-ide akan muncul dengan sendirinya dari otak kita. Dan \nbelajarlah untuk mewujudkannya dengan berbagai cara dan bantuan orang \nlain. Good Luck!<br />\n A: Tetap berkarya dan perbanyak referensi desain anda.\n</p>\n','a9acddfe385880f1a8e4f0b3a67c3484.png','9e2686139b8e66dd178519543817356d.jpg',NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:32:26','2014-12-09 12:33:47',1),(77,0,'multiple_one',9,0,6,NULL,'Selamatkan Lingkungan Melalui Diet Kantong Plastik','<p>\nMenyangkut tema yang hendak Urban Icon angkat bulan ini mengenai \nlingkungan, tim kami berbincang bersama Rahyang, perwakilan dari Diet \nKantong Plastik Indonesia yang bersama timnya mengajak warga Jakarta \nuntuk mengurangi penggunaan kantong plastik. <img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />Untuk mengenal lebih jauh mengenai campaign mereka, yuk simak interview kami.\n</p>\n<p>\n<strong>Q:</strong> <em><strong>Bagaimanakah awal mula terciptanya gerakan Diet Kantong Plastik ini ?</strong></em><br />\n <strong>A:</strong>\nGIDKP diinisiasi oleh Greeneration Indonesia di tahun 2010. Kemudian \nbaru di awal tahun 2013 bersama dengan kumpulan beberapa lembaga yang \nsebenarnya sudah lama bergerak di isu kampanye pengurangan penggunaan \nkantong plastik. Dengan tujuan besar yang sama, masing-masing lembaga \nberkomitmen untuk bersama-sama membuat working group skala nasional \nuntuk memperbesar dampak tujuan yang dicita-citakan bersama.\n</p>\n<p>\n<strong>Q: <em>Apa dampak utama dari sampah kantong plastik itu sendiri ?</em></strong><br />\n <strong>A:</strong>\nKantong plastik memakan waktu cukup lama untuk terurai, Pembakarannya \nmenimbulkan zat beracun dan berbahaya bagi manusia. Mengotori lingkungan\nmenyumbat selokan air. Selain itu sisa sampah yang ke laut dapat \nmembahayakan fauna dan ekosistem laut. Bahan baku produksi nya juga \nadalah energy tidak diperbarukan yaitu minyak bumi.\n</p>\n<p>\n<strong>Q: <em>Apakah campaign yang sedang berjalan saat ini ?</em></strong><br />\n <strong> A:</strong> Tim kami memiliki beberapa kegiatan rutin utama, yaitu\n</p>\n<ul>\n	<li>Wisata Plastik: Perjalanan susur sungai ciliwung dengan perahu karet selama 2 jam</li>\n	<li>Rampok\n	Plastik: kegiatan yang dilakukan oleh The Body Shop Indonesia untuk \n	mengedukasi dan mengajak masyarakat supaya lebih memahami bahaya dari \n	sampah kantong plastik dengan cara mengambil kantong plastik belanja \n	mereka dan ditukarkan dengan reusable bag.</li>\n	<li>Pay4plastik: petisi online, yang meminta retailers untuk tidak memberikan kantong plastik secara gratis.</li>\n	<li>Headbag\n	mob: aksi sekelompok massa dengan mengenakan reusable bag di kepala \n	sebagai simbol untuk mengingatkan masyarakat agar membawa reusable bag \n	ketika berbelanja, sehingga dapat mengurangi timbulan sampah kantong \n	plastik.</li>\n	<li>T-shirt bag: Daur ulang kaos bekas, kita dapat \n	mengurangi energi yang dibutuhkan untuk membuat tas baru atau plastik \n	yang dijadikan media untuk membawa barang belanjaan.</li>\n</ul>\n<p>\n<strong>Q:<em> Apakah kendala yang sempat dihadapi saat menghadapi campaign ?</em></strong><br />\n <strong> A:</strong>\nKendala yang kami dihadapi adalah dampak yang belum nyata terlihat. \nDiet kantong plastik merupakan perubahan sikap dan juga perilaku, perlu \nwaktu yang cukup lama dan pengukuran yang tepat untuk memastikan bahwa \nseseorang sudah benar-benar diet kantong plastik. Selain itu, mengajak \npemerintah dan retailer pun bukan perkara mudah, karena kita juga harus \nmenyinergiskan kampanye kita dengan visi dan misi mereka.\n</p>\n<p>\n<strong>Q: <em>Sebagai masyarakat, apa saja yang kita lakukan untuk meminimalisasi penggunaan kantong plastik ?</em></strong><br />\n <strong> A:</strong>\nYang terutama menggunakan kantong plastik sendiri ketika berbelanja. \nApabila erpaksa menggunakan kantong plastik, simpan kantong tersebut \nuntuk dapat dimanfaatkan kembali selama mungkin.\n</p>\n<p>\n<strong>Q: <em>Seberapa jauh dukungan pemerintah sampai saat ini untuk membantu gerakan DKP ?</em></strong><br />\n <strong>A:</strong>\nPemerintah Kota Bandung mengeluarkan Perda No.17 Tahun 2012 tentang \nPengurangan Penggunaan Kantong Plastik. Juga, di tahun 2014 Pemerintah \nDKI mengeluarkan Surat Seruan Gubernur No.1 Tahun 2014 tentang Gerakan \nJakarta Diet Kantong Plastik.\n</p>\n<p>\n<strong>Q: <em>Ada berapa jenis limbah plastik yang saat ini dapat ditemukan?</em></strong><br />\n <strong> A:</strong>\nBanyak sekali, mulai dari kantong plastik, botol plastik, plastik \nkemasan, alat-alat rumah tangga dengan berbagai warna, ukuran, dan \nbentuk. Limbah-limbah tersebut masih cukup banyak kita temukan \nberserakan dimana-mana, bahkan hingga di sungai.\n</p>\n<p>\n<strong>Q: <em>Apakah kantong plastik biodegradable dapat menjadi solusi ?</em></strong><br />\n <strong> A:</strong>\nYang menurut kami masih merupakan masalah signifikan adalah masyarakat \nmasih menggunakannya sekali pakai dan siklusnya cepat dan pembuangan \nmasih sembarangan. Energi yang dibutuhkan besar dan memerlukan waktu \ncukup lama. Proses degradasinya dalam air mengkonsumsi oksigen sehingga \nmengganggu habitat air ?dan menghasilkan metan sehingga meningkatkan \npemanasan global.\n</p>\n<p>\n<strong>Q: <em>Bagaimana cara DKP untuk menyebarkan isu tersebut melalui komunitas yang ada ?</em></strong><br />\n <strong> A:</strong>\nKami mengembangkan basis relawan di Jakarta dan Bandung untuk menjadi \nkomunikator kita dengan berbagai pihak, khususnya komunitas. Kita \nseringkali kolaborasi dengan komunitas lingkungan maupun bukan untuk \nmelakukan workshop maupun diskusi.\n</p>\n<p>\n<strong>Q: <em>Dengan retailer sendiri, bagaimana approach DKP untuk mengajak mereka peduli terhadap isu penggunaan kantong plastik ?</em></strong><br />\n <strong> A:</strong>\nTahun 2010, Diet Kantong Plastik melalui Greeneration Indonesia \nmelakukan kerjasama dengan salah satu convenience store untuk menerapkan\nSOP diet kantong plastik. Dengan SOP tersebut, kita ingin membuktikan \nbahwa dengan Diet Kantong Plastik, mereka bisa menghemat anggaran. \nBegitupun dengan Urban Icon yang sudah bekerjasama dalam mengampanyekan \nDiet Kantong Plastik melalui penggunaan tas pakai ulang dari \nGreeneration Indonesia sejak tahun 2012. Saat ini approach kita adalah \nmendorong pemerintah pusat (Kementerian Lingkungan Hidup) untuk \nmenyegerakan mengeluarkan aturan untuk mengurangi penggunaan kantong \nplastik, sehingga retailer memiliki payung hukum yang menjadi latar \nbelakang dalam upaya pengurangan penggunaan kantong plastik. Namun \ndemikian, kami pun sedang mempersiapkan bentuk apresiasi yang akan \ndiberikan kepada retailer yang sudah secara voluntary mengurangi \npenggunaan kantong plastik.\n</p>\n<p>\n<strong>Q: <em>Untuk Hidden Park sendiri, adakah campaign khusus selama event ini berlangsung ?</em></strong><br />\n <strong> A:</strong>\nKami akan melakukan kompetisi desain eco bag bersama dengan Urban Icon,\ndimana desain yang terpilih akan diterapkan pada desain reusable bag \nUrban Icon tahun 2015. Kompetisi ini akan dilakukan pada tanggal 20 \nSeptember 2014 di Taman Tanjung, Jaksel, dimana sebelumnya calon peserta\nharus melakukan registrasi pada tanggal 7-14 September 2014. Kompetisi \nini bertujuan untuk meningkatkan partisipasi publik dalam melakukan \nkampanye diet kantong plastik dan juga menjadi inspirasi bagi siapapun \nuntuk turut mendukung kampanye melalui karyanya masing-masing.\n</p>\n','0d8e7b6491218fc8112a9971279ae502.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:34:35','2014-12-09 13:57:34',1),(78,0,'none',9,0,4,NULL,'Urban Icon Installation at Hidden Park','<p>\nApabila menurut kalian pergi ke mall atau sekedar ke cafe sudah \nterlalu mainstream, coba deh untuk berkunjung ke Hidden Park di Taman \nTanjung. Sebuah taman yang terletak di Jakarta Selatan ini disulap oleh \ntim Hidden Park menjadi tempat beraktivitas bagi para masyrakat sekitar.\n<img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />Terdapat\npula focal point berupa art installation menggunakan bag dan watches \nkesayangan anda dari Urban Icon. Berikut adalah sneak peak nya.\n</p>\n<p>\nDengan\nbertemakan outdoor living room, Urban Icon mini garden terbuat dari \naksesoris dan furniture sebagai paduan alam dan suasana urban. Tas dari \nUrban Icon menjadi pot yang berisi tanaman besar dan kecil. Art \ninstallation menunjukkan penggunaan lain dari barang barang yang anda \npakai setiap hari.\n</p>\n<p>\nPot tersebut ditata di rak, ataupun diletakkan \ndi tanah. Selain itu jam tangan kami terlihat menggantung sebagai \nhanging tree decor. Display warna warni dari bathtub dan aquarium \nmelengkapi art instalation kami yang memberi suasana cerah.\n</p>\n<p>\nUntuk melihat dekorasi ini secara live, anda dapat datang langsung ke Taman Tanjung Jakarta Selatan.\n</p>\n<p>\n&nbsp;<img src=\"../../../../userfiles/Image/post/Bw_d3mjIQAAAi4N.jpg\" alt=\" \" width=\"600\" height=\"600\" align=\"middle\" />\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n','e3cffcdf5d0d0d2a5cf469932c1e6988.jpg','0846ba03ced7d8af01fcef8b5d9159a4.jpg',NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:37:27','2014-12-09 14:03:08',1),(79,0,'none',6,0,2,NULL,'Urban Icon Online Store is Back','<p>\nKami sangan gembira untuk memberitahukan bahwa Urban Icon Online \nStore kini sudah dapat diakses kembali. mohon maaf atas ketidaknyamanan \nyang terjadi karena kami mengalami gangguan teknis<img class=\"wp-more-tag mce-wp-more\" src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP/yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" alt=\"\" title=\"Read more...\" />,\nsehingga kami melakukan perombakan pada website kami ini. Website ini \nbersifat sementara, karena kami sedang melakukan another development \nuntuk website baru kami yang akan diluncurkan pada akhir tahun. Website \ntersebut memiliki banyak fitur fitur tambahan, jadi pantau timeline \nsocial media kami untuk updatenya. Sementara itu, website temporary ini \nmerupakan suatu peralihan dari website lama kami ke yang baru dan ada \nbeberapa fitur yang kami tambahkan. Simak di bawah ini untuk mengetahui \nlebih lanjut.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<strong>MENU NAVIGATION</strong>\n</p>\n<p>\nMenu yang terlihat adalah About, Cateogries, Men, Women, Brands, Blog, Latest News.<br />\n Arahkan kursor anda pada salah satu menu untuk melihat expand kategori dibawahnya. Contoh: Women - Watches<br />\n Klik, kemudian anda akan diarahkan ke halaman all women watches.\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/Screen-Shot-2014-10-03-at-9.34.02-am1.png\"><img class=\"aligncenter wp-image-9807 size-full\" src=\"../../../wp-content/uploads/2014/10/Screen-Shot-2014-10-03-at-9.34.02-am1.png\" alt=\"Screen Shot 2014-10-03 at 9.34.02 am\" width=\"1000\" height=\"569\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<strong>CONTACT US</strong>\n</p>\n<p>\nKini\nanda dapat dengan mudah menghubungi kami melalui form contact us yang \nselalu ada di pojok kanan bawah anda. Klik send untuk mengirim email \nanda.<br />\n <a href=\"../../../wp-content/uploads/2014/10/Screen-Shot-2014-10-03-at-9.37.43-am.png\"><img class=\"aligncenter wp-image-9808 size-full\" src=\"../../../wp-content/uploads/2014/10/Screen-Shot-2014-10-03-at-9.37.43-am.png\" alt=\"Screen Shot 2014-10-03 at 9.37.43 am\" width=\"1000\" height=\"570\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<strong>MY ACCOUNT MENU</strong>\n</p>\n<p>\nKlik menu my account pads bagian atlas layer untuk melihat order history anda\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/my-account-order-history1.png\"><img class=\"aligncenter wp-image-9797 size-full\" src=\"../../../wp-content/uploads/2014/10/my-account-order-history1.png\" alt=\"my account order history\" width=\"1000\" height=\"573\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<strong>PAYMENT CONFIRMATION</strong>\n</p>\n<p>\nBagi pengguna bank transfer, silahkan isi form ini supaya kami dapat mengecek pembayaran anda.\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/confirm-order1.png\"><img class=\"aligncenter wp-image-9798 size-full\" src=\"../../../wp-content/uploads/2014/10/confirm-order1.png\" alt=\"confirm order\" width=\"1000\" height=\"567\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<strong>WISHLIST MENU</strong>\n</p>\n<p>\nSekarang\nanda dapat menambahkan suatu item ke wishlist dan share item tersebut \nkepada teman teman anda. Cari item yang anda sukai lalu klik add to \nwishlist.\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/add-to-wishlist.png\"><img class=\"aligncenter wp-image-9784 size-full\" src=\"../../../wp-content/uploads/2014/10/add-to-wishlist.png\" alt=\"add to wishlist\" width=\"1213\" height=\"686\" /></a> <a href=\"../../../wp-content/uploads/2014/10/my-wishlist1.png\"><img class=\"aligncenter wp-image-9804 size-full\" src=\"../../../wp-content/uploads/2014/10/my-wishlist1.png\" alt=\"my wishlist\" width=\"1000\" height=\"611\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<strong>SOCIAL MEDIA SHARE</strong>\n</p>\n<p>\nAnda\ndapat langsung share item yang anda sukai ke sosial media anda. Pergi \nke halaman item yang anda sukai lalu klik pada salah satu ikon social \nmedia, misal twitter.\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/share.png\"><img class=\"aligncenter wp-image-9792 size-full\" src=\"../../../wp-content/uploads/2014/10/share.png\" alt=\"share\" width=\"1255\" height=\"685\" /></a> <a href=\"../../../wp-content/uploads/2014/10/twitter.png\"><img class=\"aligncenter wp-image-9791 size-full\" src=\"../../../wp-content/uploads/2014/10/twitter.png\" alt=\"twitter\" width=\"723\" height=\"173\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nFeel\nfree to browse around dan beritahu kami komentar anda melalui mention \ndi social media kami @urbaniconstore. Happy shopping !!\n</p>\n','4c2e09e360430bfb91e015e38ff989c1.png',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:40:16','2014-12-01 08:40:16',1),(80,0,'none',6,0,5,NULL,'25% off Leather Bags, Wallet, Accessories','<p>\nBeberapa dari anda, mungkin sempat berbelanja saat Sale berlangsung \ndi toko offline kami. Kini urban icon online store juga memiliki program\nsale 25% off untuk leather bags wallet dan accessories dari brand \nFossil, Desigual, Gryson, IIIBeca, Olivia Harris, Melie Bianco, \nLiebeskind. Kini adalah kesempatan terakhir anda, apabila anda mencari \nitem tertentu ditambah pula dengan harga sale.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/21.jpg\"><img class=\"aligncenter wp-image-9864 size-full\" src=\"../../../wp-content/uploads/2014/10/21.jpg\" alt=\"Print\" width=\"1600\" height=\"500\" /></a>\n</p>\n<p>\n<strong>CARA MENDAPAT POTONGAN 25%</strong>\n</p>\n<p>\nDi halaman CHECKOUT atau CART, ketik sale25 (huruf kecil tanpa spasi)<br />\n Klik &quot;apply coupon&quot;<br />\n Harga akan terpotong otomatis\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nApabila anda tidak memasukkan kode, harga yang tertera tetaplah harga awal.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/checkout1.png\"><img class=\"aligncenter wp-image-9869 size-full\" src=\"../../../wp-content/uploads/2014/10/checkout1.png\" alt=\"checkout1\" width=\"1279\" height=\"705\" /></a> <a href=\"../../../wp-content/uploads/2014/10/checkout2.png\"><img class=\"aligncenter wp-image-9870 size-full\" src=\"../../../wp-content/uploads/2014/10/checkout2.png\" alt=\"checkout2\" width=\"1280\" height=\"702\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/cart.png\"><img class=\"aligncenter wp-image-9871 size-full\" src=\"../../../wp-content/uploads/2014/10/cart.png\" alt=\"cart\" width=\"1280\" height=\"704\" /></a>\n</p>\n','d6d5cd9bac42a360e55be54b63814046.png',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:42:14','2014-12-01 08:42:14',1),(81,0,'none',8,0,5,NULL,'Watch Care Information','<p>\ndear urbanites, mengenai peraturan baru yang dikeluarkan oleh Tim \nWatch Care kami, mulai per tanggal 1 Oktober, semua jam tangan yang \nmengalami kerusakan hendaknya di drop langsung di salah satu Urban Icon \nstore tempat anda membeli atau store yang terdekat dengan anda. Watch \nCare di Menara Sudirman tidak lagi menerima customer walk in dan hanya \nmenerima jam tangan yang diserahkan oleh tim Urban Icon Store. Apabila \nada pertanyaan, anda dapat menghubungi toko urban icon terdekat dengan \nanda atau email kami melalui form contact us di page www.urbanicon.co.id\nTerima kasih atas kerja samanya.\n</p>\n','b83c62a10c839f4896e643734b8a8cc8.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:42:56','2014-12-09 14:05:02',1),(82,0,'none',6,0,5,NULL,'How to Pay Guide','<p>\nBerikut ini adalah tata cara pembayaran melalui bank transfer. \nPembayaran metod lainnya akan segera menyusul. Apabila ada pertanyaan \ndapat menghubungi kami melalui form contact us di sebelah kanan bawah \nlayar anda.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n1. Mulailah dengan memilih produk yang \nanda suka lalu tekan tombol add to cart. Bisa langsung melalui tombol \nquick add to cart atau click pada gambar untuk mask halaman detail \nproduk.\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/add-to-cart2.png\"><img class=\"aligncenter wp-image-9968 size-full\" src=\"../../../wp-content/uploads/2014/10/add-to-cart2.png\" alt=\"add to cart\" width=\"1280\" height=\"706\" /></a> <a href=\"../../../wp-content/uploads/2014/10/product-page.png\"><img class=\"aligncenter wp-image-9966 size-full\" src=\"../../../wp-content/uploads/2014/10/product-page.png\" alt=\"product page\" width=\"1280\" height=\"700\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n2. Akan ada pop up lulu click checkout\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/checkout3.png\"><img class=\"alignnone wp-image-9965 size-full\" src=\"../../../wp-content/uploads/2014/10/checkout3.png\" alt=\"checkout\" width=\"1274\" height=\"696\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n3. Isilah data customer : shipping details dan billing details. Pilih option bank transfer dan click &quot;place order&quot;\n</p>\n<p>\n<img class=\"alignnone wp-image-9969 size-full\" src=\"../../../wp-content/uploads/2014/10/checkout-page.png\" alt=\"checkout page\" width=\"1280\" height=\"702\" />&nbsp;&nbsp;<a href=\"../../../wp-content/uploads/2014/10/place-order.png\"><img class=\"aligncenter wp-image-9970 size-full\" src=\"../../../wp-content/uploads/2014/10/place-order.png\" alt=\"place order\" width=\"1280\" height=\"706\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n4.\nAnda akan sampai ke halaman konfirmasi yang berisi rekap belanja dan \nnomor akun kami. Anda harus melakukan pembayran tranfer dalam waktu 48 \njam atau order akan kami cancel.\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/thank-you-page.png\"><img class=\"aligncenter wp-image-9972 size-full\" src=\"../../../wp-content/uploads/2014/10/thank-you-page.png\" alt=\"thank you page\" width=\"1280\" height=\"707\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n5.\nPada men&uacute; di bagian atas, arahkan kursor ke &quot;my account&quot; lulu pilih \npayment confirmation. Isi data anda dan upload bukti pembayran lalu \nclick submit.\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/payment-confirmation.png\"><img class=\"aligncenter wp-image-9967 size-full\" src=\"../../../wp-content/uploads/2014/10/payment-confirmation.png\" alt=\"payment confirmation\" width=\"1280\" height=\"702\" /></a><a href=\"../../../wp-content/uploads/2014/10/payment-confirmation2.png\"><img class=\"aligncenter wp-image-9971 size-full\" src=\"../../../wp-content/uploads/2014/10/payment-confirmation2.png\" alt=\"payment confirmation2\" width=\"1280\" height=\"699\" /></a>\n</p>\n<p>\n&nbsp;\n</p>\n',NULL,NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:43:44','2014-12-01 08:43:44',1),(83,0,'none',8,0,1,NULL,'Our Team: New Store Uniform','<p>\nApabila anda baru berkunjung ke toko Urban Icon stores, mungkin anda \ndapat memperhatikan ada satu elemen yang berbeda. Team store kami baru \nsaja mendapat penampilan baru melalui seragam mereka. Uniform Urban Icon\nakan diganti per enam bulan untuk selalu tampil up to date dan supaya \nstore kami memliki suasana baru.\n</p>\n<p>\nUniform ini akan digunakan pada \nhari senin dan kamis, tim kami akan menggunakan seragam dengan warna \nmonokromatis hitam dan putih untuk kesan minimalis dan effortless \nstylish.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nUntuk\nSelasa dan Jumat, anda dapat melihat warna ikonik merah Urban Icon pada\nseragam wanita dan sentuhan warna ungu untuk pria. Uniform ini memiliki\nvibe yang fresh dan ceria.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nDi\nsamping itu, untuk rabu dan sabtu, uniform wanita bernuansa colorblock \nnavy dan krem, sedangkan pria menggunakan motif checkered yang selalu \nkami update dari waktu ke waktu.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<img src=\"../../../../userfiles/Image/post/pattern.png\" alt=\" \" align=\"middle\" />&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nBagaimana\npendapat anda mengenai uniform baru kami ? anda dapat mengirimkan \nkomentar melalui twitter atau instagram @urbaniconstore\n</p>\n<p>\n&nbsp;\n</p>\n','3892b8bfdd762bf62b8b00422014ebe7.png','6023762aa8f2b1ca7d4c1649d6b29aef.png',NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:45:06','2014-12-09 14:08:18',1),(84,0,'none',7,0,2,NULL,'Fossil 30th Anniversary Story','<p>\n<a href=\"../../../wp-content/uploads/2014/10/section_1.jpg\"><img class=\"aligncenter wp-image-10240 size-full\" src=\"../../../wp-content/uploads/2014/10/section_1.jpg\" alt=\"section_1\" width=\"1068\" height=\"408\" /></a>\n</p>\n<p>\nSalah\nsatu brand favorit kita, tak terasa telah berumur 30 tahun ini. Dari \ntahun ke tahun, Fossil terus membawa ikon vintage melalui design nya. \nSentuhan kesan American vintage dapat terlihat pada tipe leather yang \ndigunakan, pilihan warna ataupun aksen dial pada jam tangan misalnya. \nSelain produk yang worth for money, Fossil juga mengemasnya dengan \npackaging menarik yang juga menjadi suatu item yang kerap dikoleksi \nyaitu fossil tin.\n</p>\n<p>\n<img class=\"aligncenter wp-image-10235 size-full\" src=\"../../../wp-content/uploads/2014/10/1989_tinspiration-1022x1024.jpg\" alt=\"1989_tinspiration-1022x1024\" width=\"1022\" height=\"1024\" />\n</p>\n<p>\n \n</p>\n<p>\nFossil\ndidirikan pada tahun 1984 di Texas oleh Tom dan Kosta Kartsotis dengan \nproduk pertama jam tangan. Tin packaging mereka muncul pada tahun 1989 \nyang terinspirasi dari mid-century American graphics. Lalu kemudian pada\ntahun 1992, Fossil expand range produk mereka dengan leather goods tas \ndan dompet. Sejak saat itu, Fossil terus berkolaborasi dengan berbagai \ndesigner dan karakter untuk meluncurkan edisi Limited Edition products, \ndiantaranya Disney mickey Mouse, Star Wars, Frank Gehry, dan upcoming \ncollaboration untuk holiday 2014 yaitu Eley Kishimoto.\n</p>\n<p>\n<img class=\"aligncenter wp-image-10232 size-full\" src=\"../../../wp-content/uploads/2014/10/1997_vader_snoopy_mickey.jpg\" alt=\"1997_vader_snoopy_mickey\" width=\"1300\" height=\"392\" />\n</p>\n<p>\n \n</p>\n<p>\n \n</p>\n<p>\nDalam\nmenyambut 30 tahun Fossil mengeluarkan edisi khusus dari Townsman yang \nbisa digunakan oleh pria dan wanita. Dialnya memiliki grafik ala vintage\nyang ditemukan pada poster tahun 50an. Ada 1 special edition dan 4 \nlimited edition pieces yang bisa anda koleksi. Dua di antaranya dapat \nanda temukan di online store kami untuk seri <a href=\"../../../product/30th-anniversary-white/\">FS4896</a> dan seri <a href=\"../../../product/30th-anniversary-blue/\">FS4898</a>. Terdapat pula seri <a href=\"../../../product/iconic-georgia/\">Iconic Georgia</a> untuk wanita yang memiliki strap leather dengan paduan rose gold stainless steel.\n</p>\n<p>\n<img class=\"alignnone wp-image-10239 size-full\" src=\"../../../wp-content/uploads/2014/10/le_m_watch2.jpg\" alt=\"le_m_watch2\" width=\"1069\" height=\"842\" /><img class=\"aligncenter wp-image-10238 size-full\" src=\"../../../wp-content/uploads/2014/10/fossil-limited-edition.jpg\" alt=\"fossil limited edition\" width=\"640\" height=\"640\" />\n</p>\n<p>\n \n</p>\n<p>\nPada\ntahun ini, Fossil juga mengeluarkan limited edition car tin yang \nterdiri dari 6 tipe mobil yaitu Wagon, Cruiser, Futuristic, Racer, Taxi,\ndan Police Squad. Tin berbentuk mobil ini pertama kali dikeluarkan pada\ntahun 1991 seiring dengan launching Coupe De Lux watch yang \nterinspirasi dari road trip. Tertarik dengan collectible tin ini? Pantau\nterus timeline social media urban icon (instagram dan twitter) \n@urbaniconstore !\n</p>\n<p>\n<img class=\"aligncenter wp-image-10233 size-full\" src=\"../../../wp-content/uploads/2014/10/1991_fossil_coupedelux-1024x634.jpg\" alt=\"1991_fossil_coupedelux-1024x634\" width=\"1024\" height=\"634\" />\n</p>\n<p>\n<img class=\"aligncenter wp-image-10234 size-full\" src=\"../../../wp-content/uploads/2014/10/tins.jpg\" alt=\"tins\" width=\"1200\" height=\"398\" />\n</p>\n<p>\nUntuk\nmenyemarakkan 30th anniversary, tim Fossil kami juga mensponsori \nBrightspot Market 26-28 September di Senayan City dan memajang instalasi\nFossil tins pada entrance Brightspot Market. Bagaimana dengan anda? \nApabila anda penggemar fossil, ayo share outfit dan koleksi anda dengan \nhashtag instagram #fossilstyle dan mention @urbaniconstore\n</p>\n<p>\n<a href=\"../../../wp-content/uploads/2014/10/fossilsmall1.jpg\"><img class=\"aligncenter wp-image-10245 size-full\" src=\"../../../wp-content/uploads/2014/10/fossilsmall1.jpg\" alt=\"fossilsmall\" width=\"800\" height=\"800\" /></a>\n</p>\n<p>\n \n</p>\n','eebbcb1a33fdb8442573a308ee661d4f.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:46:16','2014-12-09 08:01:58',1),(85,0,'none',7,0,3,NULL,'Melie Bianco Fall Sneak Peak','<p>\nSalah satu brand handbag dari Urban Icon yaitu Melie Bianco terkenal \ndengan konsep &quot;affordable luxury&quot; nya. Brand asal New York yang \ndidirikan pada tahun 2003 oleh Melissa dan William ini memiliki sense of\nfashion yang trendy dan selalu up to date. Ia memberikan kesan \ninvestment without breaking the bank. Koleksinya juga sudah di feature \ndi berbagai majalah mancanegara seperti Marie Claire, Glamour, In Style,\nVogue, dan Cosmopolitan.\n</p>\n<p>\nPada musim fall winter tahun 2014 ini, \nMelie Bianco hadir dengan style yang tetap casual namun memiliki \nemeblishment seperti rantai dan fringe. Freestyled hobo bag dengan braid\nhandle dan trendy drawstring bucket bag merupakan koleksi yang wajib \ndimiliki oleh fashionista. &nbsp;Pilihan warnanya juga merupakan earthy tone \nkhas fall seperti brown, navy, black, mustard, dan sedikit sentuhan \nfeminin blush. Versatile dan dapat diapakai dalam berbagai suasana \ndengan harga yang terjangkau menjadikan tas tas ini sebagai koleksi yang\nmemiliki value for money.\n</p>\n<p>\nTas Melie Bianco ini akan segera dapay \nanda temukan di Urban Icon online store per minggu depan. Berikut adalah\ncuplikan sneak peak dari item baru untuk season ini.\n</p>\n<p>\n&nbsp;\n</p>\n','243258e6a67b7448c49a9fbf4702a46e.jpg','42116de556b90ce25d72a5e0caaaea87.png',NULL,NULL,NULL,NULL,'960,957,958,951,962',0,'2014-12-02 06:47:19','2014-12-09 14:22:43',1),(86,0,'none',9,0,1,NULL,'Sharing about Wonderful Indonesia in Google+','<p>\n&nbsp;\n</p>\n<p>\nDunia\nsocial media semakin marak dari hari ke hari, dan kami pun terus \nmengikuti perkembangan dunia digital. Salah satu bentuk social media \nyang menarik perhatian kami saat ini adalah Google+. Mengapa Google+ ? \nKami merasa Google+ adalah suatu platform yang memiliki sense of \ncommunity based. Ia tidak private namun juga cara berinteraksi dengan \nsesama pengguna cukup menarik dan tidak memiliki unsur spam. Nah apabila\nanda pengguna Google+, anda dapat menemukan Urban Icon di listing \nFashion and lifestyle, dan kunjungi page <a href=\"https://plus.google.com/u/0/b/111498999650019167972/+UrbaniconCoId01/posts\">Google+ Urban Icon</a> kami untuk tahu lebih banyak update dan share post dari brand kesayangan anda.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nUrban\nIcon bersama travellers favorit kami ingin share mengenai indahnya \nIndonesia kepada Urbanites melalui campaign #Indonesiaonly #Wonderful \nindonesia yang dapat dilihat page nya di <a href=\"https://plus.google.com/u/0/b/111498999650019167972/104863995924351674610/posts\">Cerita Indonesia</a>.\nAda 13 travel bloggers yang akan share mengenai berbagai tempat tujuan \nwisata di indonesia, beberapa mungkin belum terlalu komersial. \nTravellers tersebut adalah <a href=\"https://plus.google.com/u/0/b/111498999650019167972/104863995924351674610/posts\">Indohoy</a>, <a href=\"https://plus.google.com/u/0/b/111498999650019167972/+FellexandroRuby/posts\">Fellexandro Ruby</a>, <a href=\"https://plus.google.com/u/0/b/111498999650019167972/+AlderinaGracia/posts\">Alderina Gracia</a>, <a href=\"https://plus.google.com/u/0/b/111498999650019167972/+TeknoBolang\">Tekno Bolang</a>, <a href=\"https://plus.google.com/u/0/b/111498999650019167972/+rahneputri\">Rahne Putri</a>, &nbsp;<a href=\"https://plus.google.com/u/0/b/111498999650019167972/+AryanataRazki\">Aryanata Razki</a>, <a href=\"https://plus.google.com/u/0/b/111498999650019167972/+AchmadAlkatiri\">Achmad Alkatiri</a>, <a href=\"https://plus.google.com/u/0/b/111498999650019167972/+intananggita\">Intan Anggita</a>, <a href=\"https://plus.google.com/u/0/b/111498999650019167972/+MuhammadArifRahman14\">Ariev Rahman</a>, <a href=\"https://plus.google.com/u/0/b/111498999650019167972/+MarischkaPrudence/posts\">Marischka Prudence</a>, <a href=\"https://plus.google.com/u/0/b/111498999650019167972/+SwastikaNohara\">Swastika Nohara</a>,<a href=\"https://plus.google.com/u/0/b/111498999650019167972/+BarryKusuma\"> Barry Kusuma</a>, <a href=\"https://plus.google.com/u/0/b/111498999650019167972/+DianAdiPrasetyo\">Dian Adi Prasetyo</a>.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nSetiap\ntraveller akan mengadakan giveaway untuk 1 pemenang dan mereka memiliki\nitem yang berbeda beda untuk dishare! Caranya cukup gampang, hanya \ndengan memfollow and men-share foto traveller dengan hashtag \n#indoicontrip&nbsp;&nbsp;yang anda suka di Google+<br />\nMention +Urban Icon dan traveller favorit anda serta alasan kenapa anda menyukai foto tersebut.<br />\nQuiz berlangsung sampai 2 November dan para traveler akan memilih 1 pemenang nya\n</p>\n<p>\n<img src=\"../../../../userfiles/Image/post/oleh2.jpg\" alt=\" \" width=\"744\" height=\"558\" align=\"middle\" />&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nJadi\ntunggu apa lagi, kapan lagi ada kesempatan memperoleh item yang sama \ndengan blogger favorit anda? Catat juga tempat yang mereka kunjungi \nsehingga anda bisa plan untuk liburan berikutnya. Tak usah jauh jauh ke \nluar negri, karena alam negeri kita sebenarnya tak kalah menarik loh !\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n*images courtesy of respective traveler\n</p>\n','1881aa7215d824c0d108045ba343e756.jpg','c654a32a237ad4b9440e69219a6926f1.png',NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:48:05','2014-12-09 14:27:31',1),(87,0,'none',15,0,2,NULL,'Revealing food and travel with Fellexandro Ruby','<p>\n \n</p>\n<p>\n<img class=\"aligncenter wp-image-11220 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/rumah-kopi-jarod-jalan-roda-manado-wanderbites-food-travel-blog-100-copy.jpg\" alt=\"rumah-kopi-jarod-jalan-roda-manado-wanderbites-food-travel-blog-100-copy\" width=\"900\" height=\"600\" />\n</p>\n<p>\n1. Bisakah Anda ceritakan sedikit tentang diri Anda?<br />\n Saya sudah merasakan hottest chili dalam Guiness Book of Record. Keputusan terbodoh yang dibuat, but hey YOLO right?\n</p>\n<p>\n2. Sejak kapan kamu suka food photography? Mengapa?<br />\nSaya suka fotografi karena kamera pocket yang saya miliki pada \ntahun 2008. Saya memutuskan untuk fokus di makanan pada saat yang sama \nsaya memutuskan untuk blog tentang makanan pada tahun 2009.\n</p>\n<p>\n3. Apa yang membuat kamu memutuskan untuk memilih tempat untuk di review?<br />\nDulu apa yang happening, baru, atau hip. Namun belakangan yang lebih \nuntuk apa yang legendaris, through the test of time, atau unik.\n</p>\n<p>\n<img class=\"aligncenter wp-image-11223 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/14-1-2.jpg\" alt=\"14 - 1 (2)\" width=\"594\" height=\"594\" />\n</p>\n<p>\n \n</p>\n<p>\n4. Apa tantangan umum yang Anda hadapi saat menjadi food photographer?<br />\nMendidik klien. Semua orang ingin gambar yang amazing, hanya sedikit \nyang bersedia untuk berinvestasi, baik dalam seorang food photographer \natau food stylist yang tepat. Cara saya melihatnya, itu adalah sebuah \nmissed opportunity. Anda sudah berinvestasi begitu banyak dalam \ninterior, ruang & biaya tidak langsung lainnya. Namun orang tidak \nmemiliki petunjuk bagaimana makanan yang Anda sajikan tanpa gambar. A \ngood food photo is a door to a man’s belly (and wallet). Anda punya \nbanyak kesempatan untuk memikat orang dengan berbagai foto makanan dari \nwaktu ke waktu. Thats why businesses are       chroming on Instagram. We\nare visual human beings.\n</p>\n<p>\n5. Mengenai tempat untuk mengunjungi di Jakarta, apa rekomendasi mu?<br />\nAku akan mulai dengan street food. Anda dapat menemukan makanan Jepang,\nItalia, Korea di tempat lain di dunia. Tapi Anda tidak bisa menemukan \nmakanan Indonesia terbaik di tempat lain. Dalam hal itu, saya akan \nmerekomendasikan sesuatu yang legendaris dari Martabak Sinar Bulan Muara\nKarang ke Soto Bang Madun di Barito dan Ayam Berkah di Blok M.\n</p>\n<p>\n6. Apakah kamu memiliki makanan tertentu yang paling disukai? Dan di mana tempat terbaik untuk mendapatkannya?<br />\nSelain Indonesia, aku selalu penggemar berat Japanese food. Aku akan \npergi ke Echigoya untuk Gyoza mereka. Kano untuk Yakitoria. Umaku untuk \nOmakase. Sumiya for overall.\n</p>\n<p>\n7. Seberapa sering kamu melakukan perjalanan? Apakah pekerjaan Anda memungkinkan Anda untuk melakukannya sering?<br />\n I don’t keep count. But this year I think accumulatively I’m on the road about 1/4 of the time.\n</p>\n<p>\n8. Mengacu perjalanan kamu ke Manado, apakah pengalaman yang paling berkesan?<br />\nFood is amazing. I haven’t had any unpleasant food in Manado. Paling \nberkesan adalah saat saya pertama kali mencoba Perkedel Nike. That \nlittle thing           rocks my palate big time. Oh, dan pergi di Pasar \nTomohon tak terlupakan juga! Anda akan melihat kelelawar, ular, tikus, \nanjing dijual seperti bahan makanan sehari-hari.\n</p>\n<p>\n<img class=\"aligncenter wp-image-11221 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/14-1-3.jpg\" alt=\"14 - 1 (3)\" width=\"446\" height=\"594\" />\n</p>\n<p>\n \n</p>\n<p>\n9. Apa yang kamu utamakan ketika travelling? Apakah selalu makanan?<br />\nAt the risk of being seen as a glutton, I must say … YES! It is the \nfood that I always look forward to. Aku akan membuat jadwal tempat untuk\nmakan terlebih dahulu, lalu aku akan menyelipkan bebrapa itinerary \n(museum, candi, bangunan, dll) hanya untuk  membakar kalori dan \nmenyiapkan perut untuk makan lagi setelah itu.\n</p>\n<p>\n10. Apakah ada rekomendasi untuk Urbanites yang ingin mengunjungi Sulawesi?<br />\nJika Anda penggemar daging babi & makanan pedas, Manado is a must \nvisit. Mereka punya begitu banyak variasi daging babi Anda bisa coba. \nAda Sate Ragey, Soto Rusuk, Tinoransak, Babi Rica, Babi Woku, Mie Ba, \ndll. Jika Anda menyukai makanan laut, Makassar adalah tempat yang patut \ndikunjungi. Fish are fresh, and when it comes to cooking, they know \ntheir way with fish.\n</p>\n<p>\n<img class=\"aligncenter wp-image-11224 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/14-1-1.jpg\" alt=\"14 - 1 (1)\" width=\"594\" height=\"594\" />\n</p>\n<p>\n \n</p>\n<p>\n11.\nApa pendapat mu tentang fashion dan gaya saat bepergian? Are you \nconsidered as practical person or still mixing matching outfit?<br />\n I \nlove to travel in style, but not over the top. Classics work best. They \nare practical but still versatile enough to be playful.\n</p>\n<p>\n12. Apa jenis tas yang kamu suka saat bepergian?<br />\nSaya memilih satu tas yang dapat menyimpan bawaan essentials. Pada saat\nyang sama memiliki warna & bahan yang mudah untuk dicocokkan \ndengan pakaian saya.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/10/14-1-4.jpg\"><img class=\"aligncenter wp-image-11222 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/14-1-4.jpg\" alt=\"14 - 1 (4)\" width=\"446\" height=\"594\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n13. Kami melihat bahwa Anda memiliki beberapa koleksi fosil, sejak kapan kamu suka merk Fossil dan mengapa?<br />\nAku telah menggunakan fosil sejak 2010. Pada awalnya aku menggunakan \ndompetnya, kemudian berlanjut dengan segala sesuatu yang lain, jam \ntangan, tas. Saya suka kualitasnya -  I love the leather, it     gets \nbetter as it age.\n</p>\n<p>\n14. Apa utama Anda 5 harus membawa item selama bepergian?<br />\nKamera, iPhone, facial wash (it’s my quick remedy whenever I’m tired, a\nwash and I’m refreshed again), Metro / Kartu MRT (ya aku mengumpulkan \ndari beberapa negara  jadi ketika tiba, aku dapat menggunakan \ntransportasi umum to roam in the city), kertas toilet (Anda tidak pernah\ntahu kapan Anda akan membutuhkannya, but trust me you\'ll need them)\n</p>\n<p>\n15. Kata terakhir untuk berbagi tentang perjalanan di Indonesia?<br />\n Check out my blog <a href=\"http://wanderbites.com\">wanderbites.com</a> for reference on what to eat ;) Haha.\n</p>\n<p>\n \n</p>\n<p>\n<img class=\"aligncenter wp-image-11225 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/14-1.jpg\" alt=\"14 - 1\" width=\"446\" height=\"594\" />\n</p>\n<p>\n \n</p>\n<p>\n*all photos by Ruby // www.wanderbites.com\n</p>\n','1e009c8fc88c6d8fc49a5fd091935b29.jpg','629017c866810ada0c6765ec0b20af3c.jpg',NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:49:23','2014-12-09 04:31:32',1),(88,0,'none',15,0,2,NULL,'From Picnic to Travelling: An Interview with Rahne Putri','<p>\n<img class=\"aligncenter wp-image-11423 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/screen-shot-2014-10-25-at-3-26-08-pm.png\" alt=\"screen-shot-2014-10-25-at-3-26-08-pm\" width=\"560\" height=\"385\" />\n</p>\n<p>\n1. Hi Rahne, boleh ceritakan sedikit mengenai keseharian anda?\n</p>\n<p>\nHalo\nUrban Icon, Saya sehari-harinya bekerja di salah satu Digital Agency di\nJakarta. Baru saja menikah dan menalani hari juga sebagai blogger. \nSempat membat buku puisi sendiri ’Sadgenic’ & membangun komunitas \nPiknik Asik.\n</p>\n<p>\n \n</p>\n<p>\n2. Sejak kapan kamu menyukai travelling, mengapa ?\n</p>\n<p>\nSejak\npunya uang sendiri. Setelah bekerja dan bisa menabung, selalu ada \nkeinginan untuk menukarnya dengan pengalaman. Pengalaman mengunjungi \ntempat serta bertemu dengan orang baru. By travelling, I can challenge \nmyself, I learn something new, new food, new culture. I find myself on \nthe journey too.\n</p>\n<p>\n \n</p>\n<p>\n3. Bagaimana awalnya Piknik Asik terbentuk ? Menurut kami itu sangat inovatif, boleh ceritakan sedikit?\n</p>\n<p>\nSaya\norangnya suka ketemu dengan orang baru dan suka menghabiskan waktu di \ntaman. Saat pertama datang ke Jakarta, saya bingung kenapa banyak orang \nyang memilih untuk kopi darat atau ketemuan di Mall. Akhirnya di tahun \n2011, saya & teman ingin kopi darat dengan teman2 twitter berpiknik \ndi Kebun Binatang, ternyata responnya baik sekali. Ada sekitar 60 orang \nlebih yang datang hanya dari woro woro di twitter. Akhirnya dibuat rutin\ndengan nama piknik asik, jangan takut berwisata dengan teman dunia maya\nsebagai taglinenya.\n</p>\n<p>\n<img class=\"aligncenter wp-image-11427 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/tumblr_lhzh1rcpyw1qhlrg4o1_1280.jpg\" alt=\"tumblr_lhzh1rcpyw1qhlrg4o1_1280\" width=\"1024\" height=\"678\" />\n</p>\n<p>\n4. Apakah tantangan yang anda hadapi saat mengadakan acara Pikinik Asik tersebut?\n</p>\n<p>\nPaling masalah pembagian jadwal & waktu saja untuk arrange acara Piknik Asik.\n</p>\n<p>\n \n</p>\n<p>\n<img class=\"aligncenter wp-image-11422 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/14-1-21.jpg\" alt=\"14 - 1 (2)\" width=\"594\" height=\"594\" />\n</p>\n<p>\n5. Bagaimana dengan tempat menarik untuk hangout di Jakarta? Bisa share spot yang menurutmu menarik ?\n</p>\n<p>\nIf you are into music ada gig di bilangan Fatmawati, namanya Rossi Musik. Sering diadakan program, <em>live perfomance, booze</em>, dengan <em>rooftop venue. Salah satu melting point buat para pemusik dengan genre yang beragam.</em>\n</p>\n<p>\nKalau mau berpiknik, Taman Langsat di bilangan Blok M, salah satu favorit saya.\n</p>\n<p>\nDan\nsatu lagi favorit saya, TIM. Lengkap kalo mau liat pertunjukan seni, \nbioskop, teater, planetarium atau menghabiskan sore dengan nuansa \nJakarta masa lalu di Cikini.\n</p>\n<p>\n \n</p>\n<p>\n \n</p>\n<p>\n6.Mengenai trip ke Labuan Bajo, apakah pengalaman yang paling berkesan?\n</p>\n<p>\nSelama\ndi Labuan Bajo saya menyewa kapal untuk mengunjungi beberapa pulau di \nTN Komodo. Saya snorkeling di beberapa pulau dan mendapati pemandangan \nyang sangat indah. Gila. Pantai terbaik sejauh ini yang pernah saya \nkunjungi. Airnya sangat jernih, Paling berkesan saat saya trekking di \nGili Laba, saya menunggu matahari tenggelam. Setelah gelap, ternyata \nbulannya sedang bulan purnama dan hendak gerhana, terasa sangat dekat \nsekali. Saya berhasil menuruni bukit hanya dengan bantuan cahaya bulan. \nBermalam di tengah lautan dengan bulan purnama dan suara ombak. Sangat \nmenyenangkan dan menenangkan.\n</p>\n<p>\n<img class=\"aligncenter wp-image-11426 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/screen-shot-2014-10-25-at-3-09-17-pm.png\" alt=\"screen-shot-2014-10-25-at-3-09-17-pm\" width=\"560\" height=\"409\" />\n</p>\n<p>\n<img class=\"aligncenter wp-image-11430 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/screen-shot-2014-10-25-at-3-05-15-pm.png\" alt=\"screen-shot-2014-10-25-at-3-05-15-pm\" width=\"560\" height=\"416\" />\n</p>\n<p>\n \n</p>\n<p>\n7.Apakah yang paling kamu nantikan atau sukai saat travelling? Is it the nature, food, culture, art, or something else ?\n</p>\n<p>\nSemuanya.\nMakanan, alam, kultur, dan juga seni. Saya selalu menyempatkan diri \nuntuk datang ke museum atau pusat kebudayaan sebuah kota jika saya \nsedang traveling. Saya juga suka memperhatikan struktur bangunan khas \ntiap kota, mungkin itu karena saya besar di lingkungan keluarga yang \narsitek semua. Selain itu saya suka memperhatikan orang-orang local. \nBerinteraksi dan mendengarkan cerita-cerita mereka. Selalu membawa \ninspirasi bagi saya.\n</p>\n<p>\n \n</p>\n<p>\n \n</p>\n<p>\n8. Apakah ada tips untuk mereka yang ingin mengunjungi East Nusa Tenggara? (packing tips perhaps)\n</p>\n<p>\nKalo\nmau bertemu Komodo di Pulau Rinca, untuk perempuan mungkin bisa \nmencocokkan jadwal keberangkatan dengan jadwal datang bulan. Karena \nkomodo bisa mencium bau darah dan berubah menjadi ganas.  Untuk tips \nyang lain sih standar, bawa sunblock, lotion anti nyamuk, sunglasses, \ntopi, baju renang, dan baju baju yang tipis karena cuaca yang cukup \ntropis (panasss)\n</p>\n<p>\n<img class=\"aligncenter wp-image-11425 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/14-1-11.jpg\" alt=\"14 - 1 (1)\" width=\"594\" height=\"594\" />\n</p>\n<p>\n \n</p>\n<p>\n9.\n Menurutmu bagaimana mencocokkan fashion and style while travelling? \nAre you considered as practical person or still mixing matching outfit \nand what you bring during the trip?\n</p>\n<p>\nI love to travel in style \nhaha. Sebisa mungkin dalam traveling aku membawa sedikit baju tapi yang \nbisa di mix n match menjadi beberapa gaya. Biasanya saya bermain main di\ntopi, scarf atau corak baju yang disesuaikan dengan karakter tempat \ntujuan. Jangan sampe mau gaya tapi malah ribet.\n</p>\n<p>\n \n</p>\n<p>\n \n</p>\n<p>\n10. Tas seperti apa yang kamu sukai untuk dibawa travelling?\n</p>\n<p>\nSaya\ncencerung orang yang suka bawa banyak printilan di tas. Selain dompet, \nhape/ kamera harus dibawa, kemudian juga buku buat dibaca selama \nperjalanan. Jadi tas yang saya pilih biasanya yang bisa memuat semuanya \ndan bisa di mix& match dengan baju baju yang dibawa.\n</p>\n<p>\n \n</p>\n<p>\n11. Mengenai tas Liebeskind anda, fitur apa yang paling kamu sukai? Apakah anda pencinta leather goods in general?\n</p>\n<p>\nA\nFINE LEATHER bag is a work of art. Tas Liebeskind yang aku pilih ini \npunya all purpose function. Casual bisa, untuk acara formal oke, dan \nbisa dibawa traveling! Sizenya pas, gak terlalu besar atau terlalu \nkecil. Kualitas kulitnya juga bagus banget. Comfortable, stylish and \ndurable.\n</p>\n<p>\n \n</p>\n<p>\n<img class=\"aligncenter wp-image-11424 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/14-11.jpg\" alt=\"14 - 1\" width=\"638\" height=\"638\" />\n</p>\n<p>\n12. What are your top 5 must carry item during travelling?\n</p>\n<p>\nHP, iPod, parfum, kacamata, Obat-obatan.\n</p>\n<p>\n \n</p>\n<p>\n \n</p>\n<p>\n13.Last word to share about travelling in Indonesia?\n</p>\n<p>\nKenali\nIndonesia lebih jauh dengan mengunjungi tempat-tempat di luar \nrutinitasmu. Datang ke pulau lain yang bukan tanah kelahiran. Rasakan \nkekayaan Indonesia dari alam dan juga kultur budayanya, kemudian \nberbanggalah dan jaga Indonesia kita.\n</p>\n<p>\n<img class=\"aligncenter wp-image-11428 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/10/screen-shot-2014-10-25-at-3-04-12-pm.png\" alt=\"screen-shot-2014-10-25-at-3-04-12-pm\" width=\"560\" height=\"330\" />\n</p>\n','28fea55adc94b4cd44597dd7fdcc9d12.jpg','550dd01f242edbb5cca58295ce8185c1.jpg',NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:50:41','2014-12-09 04:46:13',1),(89,0,'none',12,0,2,NULL,'Fall Color Trend: Burgundy','<p>\nUntuk fall winter tahun 2014, salah satu warna trend season ini \nadalah burgundy, sebuah shade khas campuran merah dan ungu gelap. \nMungkin trend ini bia menjadi the next neutral shade, karena ia cukup \nmudah untuk di mix and match. Berikut adalah ide dari tim kami untuk \nmengenakan aksesoris berwarna burgundy untuk pria dan wanita.\n</p>\n<p>\n \n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/burgundy-trend-2014.png\"><img class=\"aligncenter wp-image-11457 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/burgundy-trend-2014.png\" alt=\"burgundy trend 2014\" width=\"673\" height=\"550\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n \n</p>\n<p>\nUntuk\nacara bersama teman atau semi formal event, kenakan little black dress \nklasik andalan anda dengan jam tangan Crocodile stamped leather dan dial\nirridescent dari DKNY <a href=\"http://urbanicon.co.id/product/soho-burgundy-crocodile/\">Soho Burgundy Crocodile</a>. Match dengan Liebeskind <a href=\"http://urbanicon.co.id/product/sally-vintage-black-wallet/\">Sally Wallet</a>\nbest seller kami serta IIIBeca North Moore satchel berbahan saffiano \nleather. Beri sentuhan akhir dengan stilleto pump heels berwarna senada \nuntuk tampilan sleek and chic.\n</p>\n<p>\n \n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/burgundy-trend-2014_2.png\"><img class=\"aligncenter wp-image-11458 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/burgundy-trend-2014_2.png\" alt=\"burgundy trend 2014_2\" width=\"647\" height=\"529\" /></a>\n</p>\n<p>\n \n</p>\n<p>\nUntuk outfit ke kantor, kami memberikan pilihan dengan sentuhan maskulin shirt dan printed pants. Jam tangan <a href=\"http://urbanicon.co.id/product/amy-red-cabernet-stainless-steel/\">Amy Red Cabernet </a>dari\nMarc by marc Jacobs terbuat dari bahan stainless steel yang versatile \ndihiasi burgundy dial dan penunjuk angka kristal. Untuk membawa berbagai\nkebutuhan dan laptop anda, tas favorit kami dari Fossil yaitu  <a href=\"http://urbanicon.co.id/product/preston-colorblock-raisin-black/\">Preston Colorblock</a>\nyang bisa ditenteng atau digunakan dengan tali shoulder yang panjang. \nMatchingkan penampian dengan dompet Fossil season ini yang multifungsi <a href=\"http://urbanicon.co.id/product/sydney-zip-clutch-black-polkadot/\">Sydney Zip Clutch</a>.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/burgundy-trend-2014_3.png\"><img class=\"aligncenter wp-image-11459 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/burgundy-trend-2014_3.png\" alt=\"burgundy trend 2014_3\" width=\"646\" height=\"387\" /></a>\n</p>\n<p>\n \n</p>\n<p>\nUntuk\npara pria modern, kami pun memiliki outfit ideas untuk working attire \natau acara formal anda. Pilihan utama kami jatuh pada Emporio Armani <a href=\"http://urbanicon.co.id/product/men-alpha-horloge-aubergine-gunmetal/\">Alpha Horloge Aubergine Gunmetal</a> yang sleek dan ringan dengan subdial untuk penanggalan. Our all time favourite <a href=\"http://urbanicon.co.id/product/estate-document-bag-dark-brown/\">Estate Document Bag Dark Brown</a> yang multifungsi dengan berbagai kompartment. Untuk membawa kartu nama atau berbagai premier membership card anda, gunakan <a href=\"http://urbanicon.co.id/product/estate-black-gusset-card-case/\">Estate Black Gusset Card Case</a>.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/burgundy-trend-2014_4.png\"><img class=\"aligncenter wp-image-11460 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/burgundy-trend-2014_4.png\" alt=\"burgundy trend 2014_4\" width=\"645\" height=\"485\" /></a>\n</p>\n<p>\n \n</p>\n<p>\nBagi anda yang berjiwa Urban, rock your style with our best selling <a href=\"http://urbanicon.co.id/product/detroit-maroon/\">Rip Curl Maroon Detroit</a>\nyang maskulin dan unik. Ia tampil modern dengan denim kesayangan anda \ndan leather jacket yang memilki kesan tough. Untuk travelling, tampil \nstylish dan bawa berbagai essential anda dengan <a href=\"http://urbanicon.co.id/product/estate-top-zip-backpack/\">Estate Top Zip Backpack</a> dan E<a href=\"http://urbanicon.co.id/product/estate-framed-leather-travel-kit-brown/\">state Framed Travel Kit</a>.\n</p>\n<p>\n \n</p>\n<p>\nSo\ngimana, Urbanites? Apabila kamu memiliki ide untuk outfit dengan warna \ntrendy season ini, dapat share ke social media kami dengan tag \n@urbaniconstore\n</p>\n','c536707184846abcd0caf1f21c3ac685.png',NULL,NULL,NULL,NULL,NULL,'1096,611,497,658,347,1159',0,'2014-12-02 06:51:58','2014-12-09 05:26:05',1),(90,0,'none',11,0,2,NULL,'Google+ Travelling Photo Roundup','<p>\nSeperti yang sudah anda ketahui melalui blog post kami sebelumnya \nmengenai kolaborasi dengan para Google+ travellers. Melalui campaign \n#wonderfulindonesia kami menyadari bahwa alam negeri kita begitu indah. \nKali ini kami akan share beberapa photo travelling round up favorit \nkami. Cerita detailnya dapat anda temukan di Google+ page masing masing \ntraveller.\n</p>\n<p>\n1. <a href=\"https://plus.google.com/b/111498999650019167972/+AchmadAlkatiri/posts\">Achmad Alkatiri</a><br />\nMad mengunjungi Sumba dan Lombok untuk #wonderfulindonesia. Lihat foto \nfoto landscape menakjukan dari Indonesia bagian Timur mulai dari laut \nsampai sabana. Jam tangan Emporio Armani Alpha Horloge terlihat sleek \nsemetara jam tangan Rip Curl  kami cocok untuk petualangan ini karena ia\nmemiliki location and tide detection.\n</p>\n<p>\n<img class=\"aligncenter wp-image-11490 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/achmad3.jpg\" alt=\"achmad3\" width=\"594\" height=\"594\" />\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/achmad-alkatiri.jpg\"><img class=\"alignnone wp-image-11463 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/achmad-alkatiri.jpg\" alt=\"achmad alkatiri\" width=\"958\" height=\"540\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n \n</p>\n<p>\n2. <a href=\"https://plus.google.com/b/111498999650019167972/+AlderinaGracia/posts\">Alderina Gracia</a><br />\nAlderina membawa tas Joy Gryson kami mengunjungi Kepulauan Maluku \ndengan pantai nya yang indah dan secluded serta berbagai keindahan alam \nlainnya.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/alderina2.jpg\"><img class=\"aligncenter wp-image-11465 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/alderina2.jpg\" alt=\"alderina2\" width=\"418\" height=\"558\" /></a>\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/alderina4.jpg\"><img class=\"aligncenter wp-image-11466 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/alderina4.jpg\" alt=\"alderina4\" width=\"837\" height=\"558\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n3. <a href=\"https://plus.google.com/b/111498999650019167972/+MuhammadArifRahman14/posts/EAZakcPfUFv\">Ariev Rachman</a><br />\nMerupakan suatu journey yang menarik karena Ariev mengunjungi dua titik\nyang sering disebut sebagai ujung dari negeri kita, yaitu Sabang dan \nMerauke. Tas Estate messenger kami pun mampir ke dua kota ini. Kunjungi \npage Ariev untuk melihat spot spot menarik yang ia tulis dalam blog nya \njuga.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/arievrubiahisland.jpg\"><img class=\"aligncenter wp-image-11468 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/arievrubiahisland.jpg\" alt=\"arievrubiahisland\" width=\"792\" height=\"594\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n4. <a href=\"https://plus.google.com/b/111498999650019167972/+AryanataRazki/posts\">Aryanata Razki</a><br />\nSimak perjalanan Aryanata ke Sulawesi untuk melihat indahnya pantai dan\nalam bawah laut di Pulau Bira, Tinabo dan Selayar sampai mempelajari \nbudaya Toraja. Jam Emporio Armani Meccanico pun menjadikan petualangan \nlebih stylish.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/aryanata.jpg\"><img class=\"aligncenter wp-image-11469 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/aryanata.jpg\" alt=\"aryanata\" width=\"958\" height=\"539\" /></a>\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/aryanatarazki-biratoselayar.jpg\"><img class=\"aligncenter wp-image-11470 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/aryanatarazki-biratoselayar.jpg\" alt=\"aryanatarazki biratoselayar\" width=\"595\" height=\"594\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n5. <a href=\"https://plus.google.com/b/111498999650019167972/+BarryKusuma/posts\">Barry Kusuma<br />\n </a>Barry\nmengunjungi bali yang kaya akan berbagai sunrise dan sunset spot nya. \nEmporio Armani kami yang modern ditampilkan dengan berbagai latar \nbelakang alam dari pantai sampai air terjun.\n</p>\n<p>\n \n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/barry-bali.jpg\"><img class=\"aligncenter wp-image-11471 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/barry-bali.jpg\" alt=\"barry bali\" width=\"829\" height=\"558\" /><br />\n </a> <a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/barrypandawabali.jpg\"><img class=\"aligncenter wp-image-11472 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/barrypandawabali.jpg\" alt=\"barrypandawabali\" width=\"407\" height=\"594\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n6. <a href=\"https://plus.google.com/b/111498999650019167972/+DianAdiPrasetyo/posts\">Dian Adi Prasetyo</a><br />\n Fossil Townsman Chronograph diajak Dian Adi mengunjungi Malang dengan berbagai keragaman kuliner khas Indonesia.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/dian-malang.jpg\"><img class=\"aligncenter wp-image-11473 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/dian-malang.jpg\" alt=\"dian malang\" width=\"792\" height=\"594\" /></a>\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/dianap6.jpg\"><img class=\"aligncenter wp-image-11474 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/dianap6.jpg\" alt=\"dianap6\" width=\"506\" height=\"675\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n7. <a href=\"https://plus.google.com/b/111498999650019167972/+FellexandroRuby/posts\">Fellexandro Ruby</a><br />\nFoto dan review dari Ruby memang selalu menjadi favorit kami. Kali ini \nia mengajak anda untuk menikmati nikmatnya kuliner di Sulawesi yang \nberaneka ragam ditemani oleh Estate backpack dari Fossil yang dapat \nmemuat kamera, laptop, dan berbagai travelling essentials.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/ruby-makassar.jpg\"><img class=\"aligncenter wp-image-11485 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/ruby-makassar.jpg\" alt=\"ruby makassar\" width=\"589\" height=\"589\" /></a>\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/ruby-danau-linow.jpg\"><img class=\"aligncenter wp-image-11484 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/ruby-danau-linow.jpg\" alt=\"ruby danau linow\" width=\"446\" height=\"594\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n8. <a href=\"https://plus.google.com/b/111498999650019167972/+indohoy/posts\">Indohoy - Saphira dan Mumun</a><br />\nKami menyukai foto foto travellling Saphira dan Mumun yang mengunjungi \nBetung Kerihun National Park. Jam tangan Ripcurl ini pun matching dengan\ntekstur wood nya yang unik.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/indohoy-borneo.jpg\"><img class=\"aligncenter wp-image-11475 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/indohoy-borneo.jpg\" alt=\"indohoy borneo\" width=\"700\" height=\"394\" /></a>\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/indohoybike.jpg\"><img class=\"aligncenter wp-image-11476 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/indohoybike.jpg\" alt=\"indohoybike\" width=\"958\" height=\"539\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n9. <a href=\"https://plus.google.com/b/111498999650019167972/+intananggita/posts\">Intan Anggita</a><br />\nIntan mengunjungi Nabire, salah satu spot di Papua yang memiliki \nkeindahan alam laut yang tiada tara. Jam tangan Karl Lagerfeld Energy \nini cocok untuk bertualang karena bentuknya yang sporty.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/intan-anggita.jpg\"><img class=\"aligncenter wp-image-11477 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/intan-anggita.jpg\" alt=\"intan anggita\" width=\"417\" height=\"558\" /></a>\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/intan3.jpg\"><img class=\"aligncenter wp-image-11478 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/intan3.jpg\" alt=\"intan3\" width=\"506\" height=\"507\" /></a>\n</p>\n<p>\n10. <a href=\"https://plus.google.com/b/111498999650019167972/+MarischkaPrudence/posts\">Marischka Prudence</a><br />\nJam tangan berdial bold color dari Michael Kors Slim Runway ini \nmenemani perjalanan Marischka menyelami indahnya Raja Ampat di Papua. \nKami sangat terkagum kagum dengan view surga laut dengan pristine \nturquiose sea dan cliff view yang amazing.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/marischkapuncakharfat.jpg\"><img class=\"aligncenter wp-image-11480 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/marischkapuncakharfat.jpg\" alt=\"marischkapuncakharfat\" width=\"586\" height=\"594\" /></a>\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/marischka3.jpg\"><img class=\"aligncenter wp-image-11479 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/marischka3.jpg\" alt=\"marischka3\" width=\"837\" height=\"558\" /></a>\n</p>\n<p>\n11. <a href=\"https://plus.google.com/b/111498999650019167972/+rahneputri/posts\">Rahne Putri</a><br />\nRahne memiliki kesempatan untuk mengunjungi Labuan Bajo, Flores \nsembari honeymoonnya. Selain itu ia pun sempat membawa tas andalan \nLiebeskind mengunjungi tembok cina.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/rahne-greatwall.jpg\"><img class=\"aligncenter wp-image-11481 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/rahne-greatwall.jpg\" alt=\"rahne greatwall\" width=\"558\" height=\"558\" /></a>\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/rahne-templeofheaven.jpg\"><img class=\"aligncenter wp-image-11482 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/rahne-templeofheaven.jpg\" alt=\"rahne templeofheaven\" width=\"417\" height=\"558\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n12. <a href=\"https://plus.google.com/b/111498999650019167972/+SwastikaNohara/posts\">Swastika Nohara</a><br />\nTraveller Swastika Nohara menjelajahi Derawan, Maratua, Kakaban, dan \nPulau Sangalaki untuk menikmati pemandangan laut dan berinteraksi dengan\npenduduk di Kepulauan Kalimantan ini. Fossil Nate Twist menemaninya \nberkeliling dari satu pulau ke pulau lain dan tetap tampil gaya.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/swastika-sangalaki-island.jpg\"><img class=\"alignleft wp-image-11486 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/swastika-sangalaki-island.jpg\" alt=\"swastika sangalaki island\" width=\"314\" height=\"558\" /></a> <a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/swastikanohara.jpg\"><img class=\"aligncenter wp-image-11487\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/swastikanohara.jpg\" alt=\"swastikanohara\" width=\"314\" height=\"558\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n \n</p>\n<p>\n13. <a href=\"https://plus.google.com/u/0/+TeknoBolang/posts\">Tekno Bolang - Sutiknyo</a><br />\nMachine Chronograph yang berkesan sporty ini menemai Sutiknyo \nmengunjungi Kalimanatan Timur. Pulau Derawan dan sekitarnya ini memang \nsedang menjadi sorotan wisatawan dalam maupun luar negeri karena \nperairannya yang tak kalah menarik dari destinasi wisata air lainnya.\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/tekno-bolang-derawan.jpg\"><img class=\"aligncenter wp-image-11488 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/tekno-bolang-derawan.jpg\" alt=\"tekno bolang derawan\" width=\"837\" height=\"558\" /></a>\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/wp-content/uploads/2014/11/tekno-bolang3.jpg\"><img class=\"aligncenter wp-image-11489 size-full\" src=\"http://urbanicon.co.id/wp-content/uploads/2014/11/tekno-bolang3.jpg\" alt=\"tekno bolang3\" width=\"892\" height=\"594\" /></a>\n</p>\n<p>\n \n</p>\n<p>\n \n</p>\n<p>\nSo,\nbagaimana dengan anda, adakah tempat tujuan wisata Indonesia yang \nhendak anda share? join the conversation at our Google+ page <a href=\"https://plus.google.com/b/111498999650019167972/+UrbaniconCoId01/posts\">here</a>.\n</p>\n<p>\n \n</p>\n','f12c4fc113d9a42bdf24fe478c8ba8b0.jpg',NULL,NULL,NULL,NULL,NULL,'694,730,346,538',0,'2014-12-02 06:52:47','2014-12-09 05:35:32',1),(91,0,'none',8,0,2,NULL,'Winner Annoucement For G+ Wonderful Indonesia','<p>\nKami sangat gembira melihat antusiasme para Google+ travellers dan \nfollowers mereka dalam campaign Wonderful Indonesia yang mengenalkan \nkepada kita spot spot wisata yang mungkin terlewat dari perhatian kita. \nSetelah periode waktu repost kontes, akhirnya kita sampai pada saat \ndimana kami tim dari Urban Icon memilih pemenang beruntung yang akan \nmendapatkan item yang sama dengan traveller favorit mereka atau item \ndari brand sama dengan value serupa saat item tersebut tidak tersedia.) \nBerikut adalah nama pemenangnya:\n</p>\n<p>\n \n</p>\n<p>\nArmani Horloge Watch AR1794  by Achmad Alkatiri - winner <a href=\"https://plus.google.com/u/0/114163690856587323691/posts/FixU9mU7BMp\">Nuruddin Kamil</a><br />\n Gryson Tote Bag  13416-BARK by Alderina Gracia - winner <a href=\"https://plus.google.com/113770774513891723098/posts/aX7amd94u3w\">Elisa Tobing<br />\n </a>Fossil Estate Sling Bag MBG9152-222 by Ariev Rachman - winner <a href=\"https://plus.google.com/113697769445392065496/posts/HNaEkwCkEeD\">Sandy Suryadinata</a><br />\n Armani Meccanico Watch AR4659 by Aryanata Razki - winner <a href=\"https://plus.google.com/116065662678519564035/posts/LY6dPZgeLvu\">Irfan Nur Liman</a><br />\n Armani AR1748 watch by Barry Kusuma - winner <a href=\"https://plus.google.com/104942592094546870121/posts/bB67eq3hKj5\">Dwi Ariyani</a> will get Armani watch AR1786<br />\n Fossil Townsman Chronograph FS4786 by Dian Adi Prasetyo - winner <a href=\"https://plus.google.com/115789293243790388978/posts/94Jj7r3wGwi\">Andrew Lumi</a><br />\n Fossil leather Backpack MBG9242-222 by Fellexandro Ruby - winner <a href=\"https://plus.google.com/114181096055823963310/posts/Tbr8CfBAkY1\">Yanuar Indrayanto</a><br />\n Rip Curl Flyer Wood Gunmetal Watch A2620-4029 by Indohoy - winner <a href=\"https://plus.google.com/u/0/105714640567937220662/posts/gWEJkm3AVdc\">Teddy Setiawan Kho</a><br />\n Karl Lagerfeld Energy Gold KL1410 by Intan Anggita - winner <a href=\"https://plus.google.com/100411302713653458691/posts/h6K6Ayfmonm\">Annisa Balqis</a><br />\n Michael Kors Slim Runway Pink Watch MK3264 by Marischka Prudence - winner <a href=\"https://plus.google.com/110812640907879540139/posts/fspTTLSNia4\">Natalia Turangan</a><br />\n Liebeskind Adrianne Leather Bag  4051436619225 by Rahne Putri - winner <a href=\"../../../wp-admin/4051436619225\">Amalia Sari<br />\n </a>Fossil Nate Twist Stainless Steel ME1132 by Swastika Nohara - winner <a href=\"https://plus.google.com/105943379414501720876/posts/hngcKE28K61\">Linda Leenk</a><br />\n Machine Chronograph Stainless Steel Watch FS4662 by Tekno Bolang - winner <a href=\"https://plus.google.com/u/0/118088398784891012197/posts/TmKzBAvrkj5\">Andi Mulya Adrianto</a>\n</p>\n<p>\n <br />\nUntuk mekanisme pengambilan hadiah, harap email ke urbanicon@time.co.id\ndata lengkap serta lampirkan data diri yang masih berlaku. We hope you \nlove the item and please post it when it reached to you ;) Once again \ncongratulations! Untuk para peserta yang belum beruntung, harap jangan \nberkecil hati, akan ada kejutan dari kami selanjutnya, stay tuned !\n</p>\n','0784de446a4d3fad5f3908cea2e99241.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:53:47','2014-12-09 14:32:55',1),(92,0,'none',9,18,2,NULL,'The Next Artsy Generation','<p>\nSelain mengagumi semangat anak muda Indonesia untuk membangun bangsa,\nada satu hal menarik lain yang kami temui di Indonesian Youth \nConference 2014, yaitu <em>art installation </em>yang merupakan hasil kurasi karya seni dari anak muda Indonesia.\n</p>\n<p>\nDari\n26 karya yang telah dikurasikan oleh Rifat Najmi (digital designer di \nCreative HotHouse) dan Satrya Damarjati (video director di Fimela \nNetworks), inilah 6 karya yang menjadi favorit kami.\n</p>\n<p>\n<strong>Mau (Cuma) Dituliskan dan Disimpan Saja?</strong>\n</p>\n<p>\nKarya dari Intan Rahmaningtyas, 19 tahun, Kalimantan Selatan\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-1-e1415608018662.jpg\"><img class=\"alignnone size-medium wp-image-11511\" src=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-1-e1415608018662-225x300.jpg\" alt=\"Mau (Cuma) Dituliskan dan Disimpan Saja?\" width=\"225\" height=\"300\" /></a>\n</p>\n<p>\n<strong>Why we love it: </strong>\n</p>\n<p>\nMaterial\nsederhana seperti kertas karton ternyata bisa diolah menjadi sebuah \nkarya seni menarik. Kami menyukai konsep ide ini untuk berani \nmenyuarakan aspirasi kita.\n</p>\n<p>\n<strong>Dream, Believe, Do It! </strong>\n</p>\n<p>\nKarya dari Puji Lestari Ciptaningrum, 20 tahun, Jakarta\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-2-e1415608477223.jpg\"><img class=\"alignnone size-medium wp-image-11513\" src=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-2-e1415608477223-300x135.jpg\" alt=\"photo 2\" width=\"300\" height=\"135\" /></a>\n</p>\n<p>\n<strong>Why we love it: </strong>\n</p>\n<p>\nKami tertarik dengan kombinasi material yang digunakan, yaitu benang wool dengan cat minyak.\n</p>\n<p>\n<strong>Puzzled Illusion </strong>\n</p>\n<p>\nKarya dari Sabila Hasya Anata, 18 tahun, Jakarta\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-31.jpg\"><img class=\"alignnone size-medium wp-image-11523\" src=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-31-300x202.jpg\" alt=\"photo 3\" width=\"300\" height=\"202\" /></a>\n</p>\n<p>\n<strong>Why we love it</strong>:\n</p>\n<p>\nIlusi optik ternyata sedang menjadi favorit di berbagai bidang seni, mulai dari fashion hingga seni lukis.\n</p>\n<p>\n<strong>The Dream Catcher</strong>\n</p>\n<p>\nKarya dari Resqi Utomo, 22 tahun, Jakarta\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-4.jpg\"><img class=\"alignnone size-medium wp-image-11515\" src=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-4-300x225.jpg\" alt=\"photo 4\" width=\"300\" height=\"225\" /></a>\n</p>\n<p>\n<strong>Why we love it: </strong>\n</p>\n<p>\nJebakan tikus diibaratkan sebagai penangkap mimpi. Tulis mimpimu dan wujudkan!\n</p>\n<p>\n<strong>Burung Biru</strong>\n</p>\n<p>\nKarya dari Kelvin Atmadibrata, Jakarta\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-5-e1415608895365.jpg\"><img class=\"alignnone size-medium wp-image-11518\" src=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-5-e1415608895365-225x300.jpg\" alt=\"photo 5\" width=\"225\" height=\"300\" /></a>\n</p>\n<p>\n<strong>Why we love it: </strong>\n</p>\n<p>\nArt installation ini sebenarnya sederhana namun tata pencahayaaan yang unik membuat pengunjung penasaran untuk melihat.\n</p>\n<p>\n<strong>Vair_gya </strong>\n</p>\n<p>\nKarya dari Gadis Fitriana Putri, 20 tahun, Jakarta\n</p>\n<p>\n<a href=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-63.jpg\"><img class=\"alignnone size-medium wp-image-11524\" src=\"http://urbanicon.co.id/../../wp-content/uploads/2014/11/photo-63-230x300.jpg\" alt=\"photo 6\" width=\"230\" height=\"300\" /></a>\n</p>\n<p>\n<strong>Why we love it:</strong>\n</p>\n<p>\nGadis\nmemilih untuk menggunakan material kayu daripada canvas biasa untuk \nmelukis. Selain itu, kami menyukai kesan misterius yang dimiliki oleh \nlukisan ini.\n</p>\n<p>\n \n</p>\n','c968dc57d1294ec1d4469ab43d383628.jpg',NULL,'<div id=\"hotspot-93\" class=\"hs-wrap hs-loading\">\n<img src=\"http://urbanicon.co.id/urbanfront/admin/../userfiles/Image/article/c968dc57d1294ec1d4469ab43d383628.jpg\">\n</div>\n','$(\"#hotspot-93\").hotspot({ \"show_on\" : \"mouseover\" });',NULL,NULL,'',0,'2014-12-02 06:55:02','2014-12-10 04:57:41',1),(93,0,'none',7,0,5,NULL,'Leather Goods Care Tips','<p>\nBagi anda penyuka leather, tentu saja terkadang anda mengalami \nkendala dalam perawatan atau saat membersihkan. Kali ini kami akan share\nkepada anda mengenai leather care tips.\n</p>\n<p>\n \n</p>\nMelindungi dari cuaca<br />\n<p>\n1. Kulit bersifatpermeabel dan tidak pernah bisa sepenuhnya tahan air, \njadi hindari menjinjing tas favorit di cuaca buruk. Meskipun demikian, \nada krim lilin lebah yang berfungsi sebagai penghalang terhadap air. \nNamun beeswax dapat merubah warna dye alami kulit, jadi coba dahulu \nsedikit sebelum menggunakan keseluruhan.<br />\n2. Alternatif yang lebih aman tetapi kurang efektif: adalah pelindung semprot, yang hampir tak terlihat pada tas Anda.\n</p>\n<br />\n<p>\nPenyimpanan<br />\n1. Kulit asli yang terbuat dari kulit binatang memerlukan udara segar. \nSimpan dalam dust bag dengan butiran serap air, jangan menyimpannya \ndalam kotak plastik yang terututup rapat. Hindari sinar matahari \nlangsung dalam waktu yang lama.<br />\n2. Setiap hari, berikan tas Anda \nsapuan cepat dengan kain lembut kering. Tidak akan mengambil waktu lama,\ntetapi akan menjaga penampilan kulit Anda lebih tahan lama.<br />\n3. Cobalah mink atau minyak neatsfoot, yang mensimulasikan dan memberi \nsuplemen minyak alami dari kulit. Biarkan selama 10 menit, kemudian \nbersihkan kelebihannya dan keringkan.<br />\n4. Simpan tas anda dengan \nstuffing butter paper yang didapa saat membeli, jangan pernah \nmenggunakan koran karena akan memberikan noda cetak.<br />\n5. Keluarkan \ndari lemari dan anginkan seminggu sekali, untuk mencegah kelembapan. \nRotasi penggunaan tas anda sehingga tak ada yang tersimpan terlalu lama.\n</p>\n<br />\n<p>\nMembersihkan<br />\n1. Bersihkan leather goods dgn kain/handuk micro fiber yg memiliki \nserat lembut supaya tidak merusak permukaan kulit, terutama pada bagian \nyang sering bersentuhan dengan kulit kita, seperti handle.<br />\n2. Jika \nkamu menggunakan cairan pembersih khusus, semprotkanlah pada kain lap \njgn pernah menyemprotkan lgsg ke permukaan leather goods.<br />\n3. Jangan pernah menggunakan pembersih berbahan dasar sintetik, khususnya yg mengandung petroleum<br />\n4. Noda pada leather goods bisa dibersihkan menggunakan saddle soap. \nTapi perlu diingat ini hanya berlaku utk noda yg masih baru \nsaja. Sebelum membersihkan dengan saddle soap ada baiknya dicoba pada \nbagian kecil yang tersembunyi kemudian bersihkan dengan lembut, jangan \ndigosok terlalu kencang.<br />\n5. Ingat juga bagian hardware. Beberapa tas\nmemiliki berharga gesper logam berlapis atau rantai. Selalu meminta \nasisten butik untuk rekomendasi perawatan.\n</p>\n','a2e6aaf81ffefd3b4e6be0f960a2a95e.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-02 06:55:55','2014-12-09 05:36:43',1),(95,0,'multiple_one',9,0,2,NULL,'Just Another piece of the Wall. Whimsical Street Art of Berlin','<p style=\"margin-bottom: 0in\">\nFlattened during World War II and\ndivided for nearly 40 years by the Berlin Wall, you would not expect\nGermany’s capital city to also be its most creative. While more\nsouthern cities like Munich and Frankfurt share the spoils as the hub\nof Germany’s economic activity, Berlin has evolved as a city with a\nrich heritage in fashion, design, music and art. \n</p>\n<p style=\"margin-bottom: 0in\">\n<br />\n</p>\n<p style=\"margin-bottom: 0in\">\nOne of the most endearing aspects to\nBerlin can be found in its street art. While graffiti is considered\nas a kind of blight in most other cities, Berliners have found a way\nto completely blanket many parts of the city with true artistic\nflair. Berlin’s famous graffiti can be found everywhere, whether it\nis on the facades of the buildings or in many of the small alleyways\nand courtyards that are symbolic of this city.\n</p>\n<p style=\"margin-bottom: 0in\">\n<br />\n</p>\n','b87c8b58c30a86008e341a5596551b64.jpeg','2976c08927644eebd6e2b669e07fd23e.jpeg',NULL,NULL,NULL,NULL,'',0,'2014-12-03 06:59:06','2014-12-09 14:56:26',1),(96,74,'0',0,0,1,NULL,'','','aa133fc97c7623fda5c5f849130eca91.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-09 11:50:37','2014-12-08 13:50:37',1),(97,74,'0',0,0,2,NULL,'','','5f7b1683bf8ba66019b756baadafd432.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-09 11:55:24','2014-12-08 13:55:24',1),(98,95,'0',0,0,2,NULL,'','<!--[if gte mso 9]><xml>\n<o:DocumentProperties>\n<o:Revision>0</o:Revision>\n<o:TotalTime>0</o:TotalTime>\n<o:Pages>1</o:Pages>\n<o:Words>176</o:Words>\n<o:Characters>1006</o:Characters>\n<o:Company>PT.Sentralwatch Perkasa International</o:Company>\n<o:Lines>8</o:Lines>\n<o:P