iority=\"33\" SemiHidden=\"false\"\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\"/>\n<w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\"/>\n<w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\n</w:LatentStyles>\n</xml><![endif]-->\n<!--[if gte mso 10]>\n<style>\n/* Style Definitions */\ntable.MsoNormalTable\n{mso-style-name:\"Table Normal\";\nmso-tstyle-rowband-size:0;\nmso-tstyle-colband-size:0;\nmso-style-noshow:yes;\nmso-style-priority:99;\nmso-style-parent:\"\";\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\nmso-para-margin:0cm;\nmso-para-margin-bottom:.0001pt;\nmso-pagination:widow-orphan;\nfont-size:12.0pt;\nfont-family:Cambria;\nmso-ascii-font-family:Cambria;\nmso-ascii-theme-font:minor-latin;\nmso-hansi-font-family:Cambria;\nmso-hansi-theme-font:minor-latin;}\n</style>\n<![endif]-->\n<!--StartFragment-->\n<p class=\"MsoNormal\">\n<span>It&rsquo;s hard to say why Berlin evolved in this\nway other than to perhaps look at its history. While many view it as an old\ncity, the reality is that large parts of Berlin had to be rebuilt in the 1950&rsquo;s\nafter the city was decimated by allied forces in the latter part of World War\nII. Following the utter destruction of their city and its division into\nAmerican, British, French and Soviet sectors leading to the eventual\nconstruction of the Berlin Wall, the city was greatly repressed in many ways.\nIn other parts of the city, entire areas surrounding the Berlin Wall were left\ncompletely empty with nothing more than dirt paths for hundreds of metres that\ncomprised of a buffer zone.&nbsp; </span>\n</p>\n<p class=\"MsoNormal\">\n<span>&nbsp;</span>\n</p>\n<p class=\"MsoNormal\">\n<span>Because families were often times divided\ninto East and West Germany by the wall, graffiti emerged as a kind of protest\nart, similar to Germany&rsquo;s indie and techno music scene. Over time, as the\nBerlin Wall emerged as a symbol of Germany&rsquo;s division, people started to draw\non the wall in a peacenik movement that aimed to pressure the governments of\nboth sides to reconcile and reunite the city, that was largely symbolized by\niconic speeches by US Presidents John F. Kennedy and Ronald Reagan.&nbsp;</span>\n</p>\n<!--EndFragment-->\n','16d9e571785d25417903bc5c5b27ad75.jpeg','58a614e10590d27de64ab4d215f8478f.jpeg',NULL,NULL,NULL,NULL,'',0,'2014-12-10 12:58:52','2014-12-09 14:58:52',1),(99,95,'0',0,0,1,NULL,'','<!--[if gte mso 9]><xml>\n<o:DocumentProperties>\n<o:Revision>0</o:Revision>\n<o:TotalTime>0</o:TotalTime>\n<o:Pages>1</o:Pages>\n<o:Words>187</o:Words>\n<o:Characters>1069</o:Characters>\n<o:Company>PT.Sentralwatch Perkasa International</o:Company>\n<o:Lines>8</o:Lines>\n<o:Paragraphs>2</o:Paragraphs>\n<o:CharactersWithSpaces>1254</o:CharactersWithSpaces>\n<o:Version>14.0</o:Version>\n</o:DocumentProperties>\n<o:OfficeDocumentSettings>\n<o:AllowPNG/>\n</o:OfficeDocumentSettings>\n</xml><![endif]-->\n<!--[if gte mso 9]><xml>\n<w:WordDocument>\n<w:View>Normal</w:View>\n<w:Zoom>0</w:Zoom>\n<w:TrackMoves/>\n<w:TrackFormatting/>\n<w:PunctuationKerning/>\n<w:ValidateAgainstSchemas/>\n<w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n<w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n<w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n<w:DoNotPromoteQF/>\n<w:LidThemeOther>EN-US</w:LidThemeOther>\n<w:LidThemeAsian>JA</w:LidThemeAsian>\n<w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n<w:Compatibility>\n<w:BreakWrappedTables/>\n<w:SnapToGridInCell/>\n<w:WrapTextWithPunct/>\n<w:UseAsianBreakRules/>\n<w:DontGrowAutofit/>\n<w:SplitPgBreakAndParaMark/>\n<w:EnableOpenTypeKerning/>\n<w:DontFlipMirrorIndents/>\n<w:OverrideTableStyleHps/>\n<w:UseFELayout/>\n</w:Compatibility>\n<m:mathPr>\n<m:mathFont m:val=\"Cambria Math\"/>\n<m:brkBin m:val=\"before\"/>\n<m:brkBinSub m:val=\"&#45;-\"/>\n<m:smallFrac m:val=\"off\"/>\n<m:dispDef/>\n<m:lMargin m:val=\"0\"/>\n<m:rMargin m:val=\"0\"/>\n<m:defJc m:val=\"centerGro