>\n<w:LsdException Locked=\"false\" Priority=\"73\" SemiHidden=\"false\"\nUnhideWhenUsed=\"false\" Name=\"Colorful Grid Accent 6\"/>\n<w:LsdException Locked=\"false\" Priority=\"19\" SemiHidden=\"false\"\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Emphasis\"/>\n<w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\"\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\"/>\n<w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\"/>\n<w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\"/>\n<w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\"/>\n<w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\"/>\n<w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\n</w:LatentStyles>\n</xml><![endif]-->\n<!--[if gte mso 10]>\n<style>\n/* Style Definitions */\ntable.MsoNormalTable\n{mso-style-name:\"Table Normal\";\nmso-tstyle-rowband-size:0;\nmso-tstyle-colband-size:0;\nmso-style-noshow:yes;\nmso-style-priority:99;\nmso-style-parent:\"\";\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\nmso-para-margin:0cm;\nmso-para-margin-bottom:.0001pt;\nmso-pagination:widow-orphan;\nfont-size:12.0pt;\nfont-family:Cambria;\nmso-ascii-font-family:Cambria;\nmso-ascii-theme-font:minor-latin;\nmso-hansi-font-family:Cambria;\nmso-hansi-theme-font:minor-latin;}\n</style>\n<![endif]-->\n<!--StartFragment-->\n<p class=\"MsoNormal\">\n<span>It turns out that one of our more iconic\nbrands, Liebeskind Berlin, has its office right along the Spree River and a\nmere 5 minute walk from the largest remaining portion of the Berlin Wall in\nEast Berlin which today has become more of an on-street gallery than a symbol\nof repression. Most of the panels on the wall reflect symbols of peace and\nunity and were painted after the wall fell (considering that East Germans would\nlikely be arrested or shot if they approached the wall during Communist times).</span>\n</p>\n<p class=\"MsoNormal\">\n<span>&nbsp;</span>Similarly, if you cross over to the Western\nside of the river, you immediately meet the district of Kreuzberg. This\ndistrict has gradually filled with immigrants from all over, and especially\nfrom Turkey, but has some tremendous examples of street art. Art comes in all\nshapes and sizes, some very small murals painted on a wall or shutter gate and\nothers taking up the entire sides of buildings.\n</p>\n<p class=\"MsoNormal\">\n<span>&nbsp;</span>\n</p>\n<p class=\"MsoNormal\">\n<span>In fact, it&rsquo;s interesting to note that\nLiebeskind has on certain occasions even designed some of the graphics on their\nbags after Berlin&rsquo;s graffiti. </span><span style=\"font-family: Wingdings\">J</span><span></span>\n</p>\n<p class=\"MsoNormal\">\n<span>&nbsp;</span>All in all, Berlin may not have the\nclassical art pedigree of a place like say Paris or Rome, but it has found a\nway to create its own kind of grassroots art that is every bit as fascinating.\n</p>\n<p class=\"MsoNormal\">\n<span>&nbsp;</span>\n</p>\n<p class=\"MsoNormal\">\n<span>&nbsp;</span>\n</p>\n<p class=\"MsoNormal\">\n<span>&nbsp;</span>\n</p>\n<p class=\"MsoNormal\">\n<span>&nbsp;</span>\n</p>\n<p class=\"MsoNormal\">\n<span>&nbsp;</span>\n</p>\n<!--EndFragment-->\n','d33baa52d95ad6bddd1e88c3e7cb14d0.jpeg','bcdb9e21bae8295b7627337718830e9d.jpeg',NULL,NULL,NULL,NULL,'',0,'2014-12-10 01:00:31','2014-12-09 03:00:31',1),(101,0,'none',13,21,1,NULL,'Product Highlight: Liebeskind Chelsea Handbags','<p align=\"justify\">\nPart of the animal leather trend that goes big this season, Liebeskind Chelsea handbag is such a versatile tote for everyday use. It gives an ordinary tote a new level of chic with the crocodile embossed cow leather. Soft to touch and comfortable to use, what&#39;s not to love about this piece? Comes with three gorgeous colour that looks bold like the blue and fire, or the neutral goodness in black. Liebeskind Berlin is well known for its casual vibe like the city itself. Not only stylish, but the handle is also comfortable to be brought all day as it gives comfort on hand or shoulder.<br />\n<br />\nWe reccommend this Liebeskind leather bag for those who love to carry a lot of things daily or would take this bag for a weekend. You wll surely look stylish on the road or in flight ! As Liebeskind is made of high quality cow leather, we asure you that it will fit for years to come. The bag is also being featured at Garuda Indonesia Colours Inflight Magazine November issue. \n</p>\n','b52d2f2b57da4fbc3f1fa61eeeaaab08.jpg','78bec540439dd8ca7b166451c3408c0e.jpg',NULL,NULL,NULL,NULL,'909,881,919',0,'2014-12-10 03:43:46','2014-12-10 03:27:14',1),(103,0,'none',8,17,2,NULL,'celebrating new urban icon online','','da2ff2a579c505fa0f81fe324c78974a.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2014-12-11 03:44:45','2014-12-10 05:44:45',1),(104,0,'multiple_pagination',15,23,1,NULL,'Featured Profile: Wynne Prasetyo and the Fashion Law','<ol>\n	<li>\n	<p style=\"margin-bottom: 0in\">\n	<font face=\"Cambria\">Can you tell\n	us a bit about yourself and what do you do daily?</font>\n	</p>\n	<font face=\"Cambria\">I&rsquo;m\n	Wynne Prasetyo, born and bred in Jakarta. A 23 years old with big\n	dreams and high hopes, aspiring to become an excellent Indonesian\n	lawyer. I have immense love for my dogs. I do fashion every time I\n	can and feel like, which is frequent every day.</font>\n	</li>\n</ol>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<ol>\n	<li>\n	<p style=\"margin-bottom: 0in\">\n	<font face=\"Cambria\">Since when do\n	you love fashion? Why do you like it?</font>\n	</p>\n	<font face=\"Cambria\">Since\n	junior high I think, when growing up began to feel exciting for all\n	the things in life I had yet to uncover.  Starting from the realizing\n	that fashion was as personal as it was global, it now feels like it\n	has been a huge part of my discovering myself and searching for my\n	place in the world. Sounds mawkish, I know, but true.</font>\n	</li>\n</ol>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<ol>\n	<li>\n	<p style=\"margin-bottom: 0in\">\n	<font face=\"Cambria\">How does the\n	blog is initially formed?</font>\n	</p>\n	<font face=\"Cambria\">I\n	had been following a few internationally known blogs and was always\n	inspired. As a part of searching for my place in the world, I\n	encouraged myself to make my own blog to see what I could be in other\n	people&rsquo;s eyes and to hopefully inspire other people like those\n	bloggers did me.</font>\n	</li>\n</ol>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<ol>\n	<li>\n	<p style=\"margin-bottom: 0in\">\n	<font face=\"Cambria\">Is there any\n	challenges for blogging ?</font>\n	</p>\n	<font face=\"Cambria\">Many.\n	Unintentionally or not, people try to take you down and tear your\n	confidence apart. Now that I have overcome that by focusing on other\n	people who have been supportive, I have grown up to this phase of\n	life where time management is a much bigger issue and it&rsquo;s just\n	hard to keep up.</font>\n	</li>\n</ol>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<ol>\n	<li>\n	<p style=\"margin-bottom: 0in\">\n	<font face=\"Cambria\">How do you\n	define your style?</font>\n	</p>\n	<font face=\"Cambria\">I\n	wear feminine with a touch of hippie looks. I get so much inspiration\n	from everything hippie and bohemian but I wouldn&rsquo;t feel balanced\n	without that extra dose of womanliness.</font>\n	</li>\n</ol>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<ol>\n	<li>\n	<p style=\"margin-bottom: 0in\">\n	<font face=\"Cambria\">Who is your\n	fashion muse?</font>\n	</p>\n	<font face=\"Cambria\">Hard\n	to name one but a figure I have loved the longest is Mischa Barton.</font>\n	</li>\n</ol>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<ol>\n	<li>\n	<p style=\"margin-bottom: 0in\">\n	<font face=\"Cambria\">Referring\n	your blogging history, what is the most memorable experience?</font>\n	</p>\n	<font face=\"Cambria\">When\n	some of my peers began to relate to my real life as a law school\n	student (back then) and they started reaching out to me to extend\n	their support or otherwise ask me to support them. It&rsquo;s no <em>grande</em>,\n	but it is definitely the most personally satisfying kick I have got\n	out of blogging thus far.</font>\n	</li>\n</ol>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<ol>\n	<li>\n	<p style=\"margin-bottom: 0in\">\n	<font face=\"Cambria\">What do you\n	think about the blogging industry in Indonesia ?</font>\n	</p>\n	<font face=\"Cambria\">It&rsquo;s\n	growing to a whole other level than what it was in my early days of\n	blogging, in a good way. People used to worship fashion feed and lack\n	appreciation for the personality the blogger was trying to shape.\n	These days personality and indie-ness rival physical beauty and\n	flashy style in terms of popularity and relatability. I think we are\n	getting closer to what blogs are actually invented for.</font>\n	</li>\n</ol>\n','f81ae49f65e7426eba34bc3a040e7a87.jpg','57735786d1d76fe4db63123e585d5ed7.jpg',NULL,NULL,NULL,NULL,'616,1164,752,537',0,'2014-12-13 08:51:36','2014-12-12 11:02:11',1),(105,0,'0',0,0,0,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,NULL,'0',0,'2014-12-13 09:11:52','2014-12-12 11:11:52',0),(106,104,'0',0,0,2,NULL,'','<p>\nP { margin-bottom: 0.08in; }\n</p>\n<p style=\"margin-bottom: 0in\">\n<font face=\"Cambria\">9.What is your\nfavorite trend for fall winter 2014 ?</font>\n</p>\n<font face=\"Cambria\">Gotta\nsay I love turtle necks and big grey bags!</font>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<font face=\"Cambria\">10. What do you\nthink about fashion and style while travelling? Are you considered\nas practical person or still mixing matching outfit and what you\nbring during the trip?<br />\n</font><font face=\"Cambria\">I\npack my most favorite pieces in my luggage when I travel and leave\nthe mixing and matching hype for down the road. I get inspirations\nfrom the &ldquo;different world&rdquo; I see when travelling and my style\nnormally evolves a bit to adapt with how people in the &ldquo;different\nworld&rdquo; dress. This helps me relate to the places I travel to.</font>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<font face=\"Cambria\">11.What type of\nbag do you like ?</font><font face=\"Cambria\"><br />\nOh I don&rsquo;t have\na preference, it changes every time.  </font>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<font face=\"Cambria\">12. What are your\ntop 5 must carry item daily?</font><font face=\"Cambria\"><br />\nMy iPhone, dark\ngreen Celine wallet, a lipstick, my pouch of hair ribbons, and\nearphones.</font>\n</p>\n<p>\n13. What is your\nfavourite brand from urban icon and why?<br />\n<font face=\"Cambria\">Emporio\nArmani. Love all the designs and it looks very masculine!</font>\n</p>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<font face=\"Cambria\">14. Do you have\nany whopping tips for our readers ?</font><font face=\"Cambria\"><br />\nConfidence\nis key to good fashion. Find your source of confidence. Being an\nintrovert that I am, I derive this from my inner self. But in days\nwhere that fails me, I know I gain happiness from smiling to other\npeople. Find yours.</font>\n<p style=\"margin-left: 0.5in; margin-bottom: 0in\">\n<br />\n</p>\n<font face=\"Cambria\">15. Last word to\nshare about fashion industry in Indonesia?</font><font face=\"Cambria\"><br />\nFashion\nis much braver and bolder today than it ever was. It could be\npoisonous, not few people lose themselves struggling to be a little\nsomething in the industry.  But it could be positive too. I hope the\nfashion industry will grow to spread more positive influence to more\npeople, by promoting self-worthiness and the value of real,\nunpretentious personality.</font>\n<p style=\"margin-bottom: 0in\">\n<br />\n</p>\n<p style=\"margin-bottom: 0in\">\n<br />\n</p>\n','041ae656fc64b7594d06e6fdd5ae466c.jpg','06db659517fc037061d56746acbe5eb9.jpg',NULL,NULL,NULL,NULL,'951,713',0,'2014-12-13 09:15:46','2014-12-12 11:15:46',1),(107,0,'none',8,17,1,NULL,'Urban Icon Kota Kasablanka','<p>\nWe are happy and proud to announce our 18th store that is located in Jakarta, which is Kota Kasablanka. This spacious store is located at the UG floor of the mall, strategically located near the escalator. The store carries the brands such as Marc by Marc Jacobs, Emporio Armani, Fossil bags and watches, Rip Curl, Michael Kors, Karl Lagerfeld, Liebeskind, and Melie Bianco. It implements the new concept of Urban Icon store that has homey and comfortable feeling with a sense of modern industrial elements such as the usage of hollow metal fixture and the backwall for display. Sofa, stool, and yellowish lighting as well as wooden floor gives a sense of comfort and welcoming customer to browse the products. Similar to other Urban Icon stores, the cashier area is also being decorated with mural, specially made for Urban Icon Kota Kasablanka.&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nFor more information, please visit our store located at<br />\nMall Kota Kasablanka Unit UG 05 A, JL. Casablanca Raya Kav. 88, Jakarta Pusat, DKI Jakarta 12870, Indonesia<br />\n021-294 751 38\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp; \n</p>\n<p>\n&lt;!-- \nBODY,DIV,TABLE,THEAD,TBODY,TFOOT,TR,TH,TD,P { font-family:\"Arial\"; font-size:x-small }\n--&gt;\n&nbsp;\n</p>\n','84968e0170662ceb34c2633c7c254374.JPG','dd9488637fff083dcfc02e69acaaa28a.JPG',NULL,NULL,NULL,NULL,'',0,'2015-01-08 03:55:32','2015-01-07 05:55:32',1),(108,0,'none',8,17,1,NULL,'Christmas Vibe in Urban Icon Stores','In the festive season, Urban Icon store also has a special christmas themed window display that will be up from December to January. Holiday elements like christmas tree is made modern with the structure to display watches. The background carries the warmth of house log in the winter. The watches and bag for display are choosen with metallic, and red elements. \n','fe848047be83f687b2403e32e8794317.JPG','569be3a5cc72be0b33e3035d36b04e52.JPG',NULL,NULL,NULL,NULL,'',0,'2015-01-08 04:27:49','2015-01-07 06:27:49',1),(109,0,'none',15,23,1,NULL,'Featured Profile: Arnold Teja and Men\'s Fashion in Indonesia','<p>\n<font face=\"Calibri\">Q: Can you tell\nus a bit about yourself and what do you do daily?</font>\n<br />\n<br />\n<font face=\"Calibri\"><span>A: Hi, my name is\nArnold Teja, I&rsquo;m 19 years old, living in Jakarta, Indonesia. I&#39;m a\ngraphic design student who loves pretty clothes and stuffs and then\nblogging about it.</span></font>\n<br />\n<br />\n<br />\n</p>\n<p>\n<font face=\"Calibri\">Q: Since when do\nyou love fashion? Why do you like it?</font>\n</p>\n<font face=\"Calibri\">A: I&rsquo;ve\nbeen interested in fashion since I was a kid. It&rsquo;s always amazes me\nhow Fashion can change the attitude of the invidual. </font><font face=\"Calibri\"><span>The\nway it can give that little confidence boost when you&rsquo;re not\nfeeling yourself. And I think there&rsquo;s no easier way to express\nourself than through the clothes we wear.</span></font>\n<br />\n<br />\n<br />\n<p>\n<font face=\"Cambria\"><font face=\"Calibri\">Q: How\ndoes the blog is initially formed? </font></font>\n</p>\n<font face=\"Calibri\">A: I\nstarted my blog when I was 15 years old. As a teenager, I&rsquo;m still\nf</font><font face=\"Calibri\"><span>iguring\nout who I want to be as a person and what I want to be recognized\nfor. I want the world to know about what inspires me. And I think by\nsharing my passions through blogging, I&rsquo;ll be able to connect with\nmore people and create more friendships.</span></font>\n<br />\n<p>\n&nbsp;\n</p>\n<p>\n<br />\n<br />\n<font face=\"Calibri\">Q: Is there any\nchallenges for blogging ?</font>\n<br />\n<br />\n<font face=\"Calibri\">A: The\nchallenges are to maintain consistency and find a good balance\nbetween time spent on studying,  working (I&rsquo;m currently working as\na fashion stylist for a magazine) and blogging.</font>\n<br />\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<font face=\"Calibri\">Q: How do you\ndefine your style?</font>\n</p>\n<font face=\"Calibri\"><span>A: I don&#39;t think\nI can really categorize my style in a single taxonomy. It changes but\nI prefer to keep it clean and minimalist with a little twist by\npaying attention to little details including cuts, textures, pattern\nand layers</span></font>\n<br />\n<br />\n<br />\n<p>\n<font face=\"Calibri\">Q: Who is your\nfashion muse?</font>\n</p>\n<font face=\"Calibri\">A: I\ndon&rsquo;t have a specific muse. My inspiration can come from anyone or\nanything.</font>\n<br />\n<br />\n<br />\n<p>\n<font face=\"Calibri\">Q: Referring\nyour blogging history, what is the most memorable experience?</font>\n</p>\n<font face=\"Calibri\">A: When\nI get featured in the New York Times and being a brand ambassador for\none of international fashion retailers</font>\n<br />\n<br />\n<br />\n<p>\n<font face=\"Cambria\"><font face=\"Calibri\">Q: What\ndo you think about the men&#39;s fashion in Indonesia ? </font></font>\n</p>\n<font face=\"Cambria\"><font face=\"Calibri\">A: Thanks\nto the internet, Indonesian men are getting more and more informed\nabout trends and breaking the boundaries when it comes to dressing up\nand that makes them becoming more fashion conscious </font></font>\n<br />\n<br />\n<br />\n<p>\n<font face=\"Calibri\">Q: From all\nfashion items, what item do you like the most ? (bags or shoes\nor..?)</font>\n</p>\n<font face=\"Calibri\">A: Shoes!\nBecause I believe that good shoes take us to good places.</font>\n<br />\n<br />\n<br />\n<font face=\"Calibri\">Q: What is your\nfavorite trend for resort 2015?</font>\n<br />\n<br />\n<font face=\"Calibri\"><span>A: This fall\nis&nbsp;</span></font><font face=\"Calibri\"><strong><span>all</span></strong></font><font face=\"Calibri\"><span>&nbsp;about\nchic&nbsp;</span></font><font face=\"Calibri\"><strong><span>oversized</span></strong></font><font face=\"Calibri\"><span>&nbsp;silhouettes.\nThe bigger the better. From boxy tops, tailored overcoats to slouchy\ntrousers. </span></font>\n<br />\n<br />\n<br />\n<p>\n<font face=\"Calibri\">Q: What do you\nthink about fashion and style while travelling? Are you considered\nas practical person or still mixing matching outfit ?</font>\n</p>\n<font face=\"Cambria\"><font face=\"Calibri\">A: I\nlove to travel in style, but light. I always checks the weather and\ntakes into account the culture of the country I&rsquo;m visiting before\nhand and carries clothes accordingly. Usually a few days before the\ntrip I will plan each day&rsquo;s look in advance and take exactly what I\nwill use</font></font>\n<br />\n<br />\n<br />\n<font face=\"Calibri\">Q: What are your\ntop 5 must carry item daily?</font>\n<br />\n<br />\n<font face=\"Cambria\"><font face=\"Calibri\">A: Wallet,\nwatch, cellphone, ipod, glasses and perfume</font></font>\n<br />\n<br />\n<br />\n<br />\n<br />\n<p>\n<font face=\"Calibri\">Q: What type of\nwatch do you like ? Do you considered watch as must wear item daily?</font>\n</p>\n<font face=\"Calibri\"><span>A: I\nprefer a slim, unadorned timepiece with a plain black or white face\nand black leather strap or silver steel bracelet. </span></font><font face=\"Calibri\"><span>It\nneeds to become a watch that takes on the personality of whatever I&#39;m\nwearing.</span></font>\n<br />\n<font face=\"Calibri\"><span>I\nknow that in this modern life. we&#39;ve got cellphones and whatever\nother gadgets to tell us the time. But I remain firm believe that\nwatches are still worth wearing. </span></font><font face=\"Calibri\"><span>Peeking\nat your phone in the middle of something important</span></font><font face=\"Calibri\">\n</font><font face=\"Calibri\"><span>is\noften bad form. A watch makes it much easier to check the time on\nstyle.</span></font><font face=\"Calibri\"> </font><font face=\"Calibri\"><span>And\nlike handbags, watches are highly visual symbols of status,\nassociation and identity, it s</span></font><font face=\"Calibri\"><span>ays\nsomething about the wearer, intentionally or not.</span></font>\n<br />\n<br />\n&nbsp;\n<br />\n<p>\n<font face=\"Calibri\">Q: What is your\nfavourite brand from urban icon and why?</font>\n</p>\n<font face=\"Calibri\">A: Marc\nby Marc Jacobs. T</font><font face=\"Calibri\"><span>heir\ncollection</span></font><font face=\"Calibri\"><span>&nbsp;has\na free-spirited, New York vibe </span></font><font face=\"Calibri\"><span>to\nfit young, stylish people. </span></font>\n<br />\n<br />\n<br />\n<p>\n<font face=\"Calibri\">Q: Do you have\nany shopping tips for our readers ?</font>\n</p>\n<font face=\"Calibri\">A: Use your\ncredit card installment with zero charges program </font><font face=\"Calibri\">if\nyou are going to make an expensive purchase. </font><font face=\"Calibri\"><span>But\n</span></font><font face=\"Calibri\">don&rsquo;t overload your cards. Keep\nyour spending to less than 30&nbsp;percent of your available credit\ncard balance</font>\n<br />\n<p>\n<font face=\"Calibri\">Shop online.\n</font><font face=\"Calibri\"><span>One of\nthe biggest advantages of buying online is the freedom from crowds.\nThis means you have the time to view any item you want for as long\nas you want. You can look up expert advice and customer reviews all\nat the same time so you can get the right deal. Since you don&rsquo;t\nneed to visit a store, you don&rsquo;t need to waste any money on fuel\nto get to the location. You also save on any parking fees and avoid\nthe temptation of other shops. you can skip the queue and buy items\ninstantly.</span></font>\n</p>\n<font face=\"Calibri\">Signing\nup for loyalty card and/or e-mail alerts can net some greatdeals.</font>\n<br />\n<br />\n<br />\n<font face=\"Calibri\">Q: Last word to\nshare about fashion industry in Indonesia?</font>\n<br />\n<br />\n<font face=\"Calibri\">A: We&rsquo;re\nstill exploring and catching up. Hopefully, if the politics and\neconomics are getting better, Indonesia will be a potential spot as\none of the fashion capital city in Asia. We got great cultures,\nheritage, great talents and great level of consumerism.</font>\n<br />\n<br />\n','a7bd20acf12ed4c4a74ce61b8bfb2d73.jpg','ad385b0265e33f46a74ef82f5bdb7e5c.jpg',NULL,NULL,NULL,NULL,'246,633,139,637',0,'2015-01-08 05:17:41','2015-01-08 11:15:27',1),(110,0,'none',13,21,2,NULL,'Fossil Grant Automatic','<p>\nGrant series is one of the most sought after from Fossil. With its midsize dial for men, it has the quality of workmanship and design that is inspired by the classic horlogerie. This season, Grant comes with automatic movement that has trasparent dial showcasing the wonders of its mechanical movement. A fine balance of slim band and the intricate dial that becomes its own charm. It brings out Fossil vintage heritage with its bold roman numeral and handsome grained leather that will only be better looking over time. Crafted in genuine leather strap, it comes in classic neutral colors, brown, black, and navy that can be worn day or night. The bezel comes with classic silver and rose gold tone for those eager to look out of the box. A very classic pieces that make the wearer looks sophisticated in all occassions. This men essential with automatic movement will give you accuracy up to 48 hours if not worn \n</p>\n<p>\n&nbsp;\n</p>\n<p>\nCase Thickness: 13mm, Water Resistant: 5 ATM, Closure: Strap Buckle, Band Width: 22mm, Circumference: 200 +/- 5mm, Case Size: 44mm\n</p>\n','e4ec1e7d612c511cb7d89fcd5f8ad6e2.png',NULL,NULL,NULL,NULL,NULL,'1299,1300',0,'2015-01-09 08:59:05','2015-01-08 11:10:15',1),(111,0,'multiple_pagination',12,15,2,NULL,'Editorial: The Style Resolution','As 2015 approaches, we are slowly adapting the style changes. In this editorial, Urban Icon captivates the elegance of embracing a new beginning and a new hope. With pieces that sparks excitement for the upcoming phrase in life. Subtle glimmers with a base hue of black and white, the featured bags and timepieces are must have for a stylish beginning.\n','de5ac8ae5031e7f763e6b00b797798c8.jpg',NULL,NULL,NULL,NULL,NULL,'',0,'2015-01-13 12:18:09','2015-01-12 14:19:41',1),(112,111,'0',0,0,2,NULL,'','','0859c70c8e2237d5faab74068567cec6.jpg',NULL,'<div id=\"hotspot-50\" class=\"hs-wrap hs-loading\">\n<img src=\"http://urbanicon.co.id/adminuicon/../userfiles/Image/article/0859c70c8e2237d5faab74068567cec6.jpg\">\n <div class=\"hs-spot-object\" data-type=\"spot\" data-x=\"224\" data-y=\"330\" data-width=\"30\" data-height=\"30\" data-popup-positi data-visible=\"visible\" data-tooltip-width=\"200\" data-tooltip-auto-width=\"true\">\n<a >LIEBESKIND BERLIN Venne Taupe Wallet</a>\n</div>\n <div class=\"hs-spot-object\" data-type=\"spot\" data-x=\"778\" data-y=\"360\" data-width=\"30\" data-height=\"30\" data-popup-positi data-visible=\"visible\" data-tooltip-width=\"200\" data-tooltip-auto-width=\"true\">\n<a >FOSSIL Jacqueline Glitz Rose Gold Stainless</a>\n</div>\n</div>\n','$(\"#hotspot-50\").hotspot({ \"show_on\" : \"always\" });',NULL,NULL,'',0,'2015-01-13 12:20:09','2015-01-12 06:22:19',1),(113,111,'0',0,0,1,NULL,'','','982318296f5c0850c3ce726a8d60710b.jpg',NULL,'<div id=\"hotspot-81\" class=\"hs-wrap hs-loading\">\n<img src=\"http://urbanicon.co.id/adminuicon/../userfiles/Image/article/982318296f5c0850c3ce726a8d60710b.jpg\">\n <div class=\"hs-spot-object\" data-type=\"spot\" data-x=\"565\" data-y=\"357\" data-width=\"30\" data-height=\"30\" data-popup-positi data-visible=\"visible\" data-tooltip-width=\"200\" data-tooltip-auto-width