INSERT INTO `newsletter_news` VALUES (1,'Promosix','Promotion deskripsix\r\n',0),(2,'Promo Bulan Mei - Juni 2015, Discount Sampai 15 %','<p>\r\nPromo Bulan Mei - Juni 2015, Discount Sampai 15 %\r\n</p>\r\n<p>\r\n<img src=\"../../../../../adminuicon/assets/elfinder/files/Image/brand_product/images3.jpg\" alt=\" \" width=\"259\" height=\"194\" />&nbsp;\r\n</p>\r\n<p>\r\n <span Helvetica Neue\",Helvetica,Arial,sans-serif; font-size: 14px; line-height: 20px; text-align: justify\">Pada Senin 8 Juni 2015 bertempat di Istana Negara, BNSP melakukan audiensi kepada Presiden RI Joko Widodo. Delegasi BNSP terdiri dari Ketua dan 20 Anggota serta Kepala Sekretariat sedangkan Presiden Joko Widodo didampingi oleh Mensetkab Andi Wijayanto. Pada kesempatan audiensi tersebut Ketua BNSP Sumarna F. Abdurahman melaporkan tentang Renstra dan Program Kerja BNSP Tahun 2015 yang fokus pada percepatan sertifikasi kompetensi menghadapi MEA 2015. &nbsp;Dalam arahannya Presiden Joko Widodo mengatakan akan mempertimbangkan usulan BNSP untuk meningkatkan kapasitas kelembagaan BNSP melalui revisi PP No.23/2004. &nbsp;Selain itu, Presiden juga akan mempelajari usulan BNSP tentang sistem insentif untuk industri yang mempekerjakan tenaga kerja bersertifikat.</span>&nbsp;\r\n</p>\r\n',10);
/*!40000 ALTER TABLE `newsletter_news` ENABLE KEYS */;
UNLOCK TABLES;

