INSERT INTO `t_logo` VALUES (2,'Desigual','Desigual1.jpg','<div style=\"text-align: justify\">\n<font face=\"Arial, Helvetica, sans\"><span style=\"font-size: 11.1111116409302px; line-height: 14px\">Born in 1984, Desigual starts to dress people in a fun and innovative way. With its textures, splash of colour, and embellishment in bags and accessories, Desigual brings out cheer and sense of humour in its pieces. Now available in 72 countries worldwide, this Spanish brand continues to inspire fashionistas with its collection.</span></font>\n</div>\n','Y','2014-11-05 07:58:33',1,'2014-12-11 10:02:49',NULL,NULL,NULL),(3,'DKNY','DKNY2.jpg','<!--[if gte mso 9]><xml>\n<o:DocumentProperties>\n<o:Revision>0</o:Revision>\n<o:TotalTime>0</o:TotalTime>\n<o:Pages>1</o:Pages>\n<o:Words>36</o:Words>\n<o:Characters>209</o:Characters>\n<o:Company>PT.Sentralwatch Perkasa International</o:Company>\n<o:Lines>1</o:Lines>\n<o:Paragraphs>1</o:Paragraphs>\n<o:CharactersWithSpaces>244</o:CharactersWithSpaces>\n<o:Version>14.0</o:Version>\n</o:DocumentProperties>\n<o:OfficeDocumentSettings>\n<o:AllowPNG/>\n</o:OfficeDocumentSettings>\n</xml><![endif]-->\n<!--[if gte mso 9]><xml>\n<w:WordDocument>\n<w:View>Normal</w:View>\n<w:Zoom>0</w:Zoom>\n<w:TrackMoves/>\n<w:TrackFormatting/>\n<w:PunctuationKerning/>\n<w:ValidateAgainstSchemas/>\n<w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n<w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n<w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n<w:DoNotPromoteQF/>\n<w:LidThemeOther>EN-US</w:LidThemeOther>\n<w:LidThemeAsian>JA</w:LidThemeAsian>\n<w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n<w:Compatibility>\n<w:BreakWrappedTables/>\n<w:SnapToGridInCell/>\n<w:WrapTextWithPunct/>\n<w:UseAsianBreakRules/>\n<w:DontGrowAutofit/>\n<w:SplitPgBreakAndParaMark/>\n<w:EnableOpenTypeKerning/>\n<w:DontFlipMirrorIndents/>\n<w:OverrideTableStyleHps/>\n</w:Compatibility>\n<m:mathPr>\n<m:mathFont m:val=\"Cambria Math\"/>\n<m:brkBin m:val=\"befo