INSERT INTO `timeliner` VALUES (2,'2009','<p>Our first Urban Icon store is established in Mall Kelapa Gading 3</p>','2009','0000-00-00','0000-00-00','Y','2014-10-12 05:21:15',1,'2014-12-08 11:24:04',1,NULL,NULL),(4,'2013','<p>Customers in Balikpapan and Bogor now can shop in our stores. We also add another store in Lippo Mall Kemang Jakarta. In the same year, we also expand our brand selections, the new coming brands are Melie Bianco, Liebeskind Berlin, IIIBeca, Gryson, and Olivia Harris. For watch, we have Karl Lagerfeld to join Urban Icon..</p>','2013','0000-00-00','0000-00-00','Y','2014-11-10 05:40:30',1,'2014-12-10 02:36:24',2,NULL,NULL),(5,'2011','<p>Two new stores were opened in Central Park and Grand City Surabaya. We also welcomed Marc by Marc Jacobs, Michael Kors, and Desigual in Urban Icon.</p>','2011','0000-00-00','0000-00-00','Y','2014-11-10 06:13:59',1,'2014-12-10 08:08:13',1,NULL,NULL),(6,'2010','<p>In 2010, we open our stores in Plaza Indonesia, followed by Trans Studio Makassar and Paragon Mall Semarang in third quarter of the year.</p>','2010','0000-00-00','0000-00-00','Y','2014-11-11 03:12:02',1,'2014-12-10 02:33:36',1,NULL,NULL),(7,'2014','<p>We upgraded our store with a new feel and look. Working together with Domisilium we give a new urban life to Grand Indonesia store in June as well as the opening of our Liebeskind pop up store.<br /><br />Next, we get Mall Kelapa Gading 3 relocated to a bigger and more convenient space. Another relocation also occurs in Plaza Indonesia in July.<br /><br />We recently opened our 18th store at Mall Kota Kasablanka with the same urban vibe.</p>','2014','0000-00-00','0000-00-00','Y','2014-12-02 08:28:46',1,'2014-12-08 11:29:53',1,NULL,NULL),(8,'2012','<p>Urban Icon store has a new look! A newly revamped store with new ambience designed by Indez Design pte ltd can be experienced by customers in Pondok Indah Mall and Ciputra World Surabaya.<br /><br />We also open a new concept store at Beach Walk Bali. Our first look of Urban Icon online store launched in July 2012.</p>','2012','0000-00-00','0000-00-00','Y','2014-12-03 05:56:15',0,'2014-12-10 02:34:04',1,NULL,NULL);
/*!40000 ALTER TABLE `timeliner` ENABLE KEYS */;
UNLOCK TABLES;

